-- ----------------------------
-- Procedure structure for Pro_Med_InOut_Submit
-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[Pro_Med_InOut_Submit]') AND type IN ('P', 'PC', 'RF', 'X'))
	DROP PROCEDURE[dbo].[Pro_Med_InOut_Submit]
GO

CREATE PROCEDURE [dbo].[Pro_Med_InOut_Submit]
	@InOutID varchar(12),  --单号
	@OpID varchar(8),  --申请人
	@OfficeID varchar(8),  --申请科室
	@NewState int output  --提交后申请单的状态
as
BEGIN

/*********************************************************************
	出入库业务状态：
	0  正在申请（正在录入编辑）
	1  确认申请（录入完成确认）
	10 完成（或者接收单位已执行）
*********************************************************************/

	declare @ReturnValue int,
	@InOutSign int,
	@AcceptOfficeID varchar(8),
	@SupplyName varchar(100)

	begin tran	

	--读取出入库标识、接收科室、供应商
	select @InOutSign = InOutSign, 
		@AcceptOfficeID = isnull(AcceptOfficeID, ''),
		@SupplyName = isnull(SupplyName, '')
	from Med_InOutMaster
	where InOutID = @InOutID

	if @AcceptOfficeID = ''
	begin
		--如果是科室内部业务，状态改为10
		set @NewState = 10
	end
	else begin
		--如果是申请单，状态改为1，由接收申请单后改为10
		set @NewState = 1
	end
	
	if (select COUNT(*) from Med_InOutDetail where InOutID = @InOutID) = 0
	begin
		raiserror('药品出入库：提交前请输入明细数据', 16, 1)
		goto ErrorProcess
	end
			
	--修改出入库状态志，只能由本人进行操作
	update Med_InOutMaster
	set InOutState = @NewState, AcceptTime = getdate()
	where InOutID = @InOutID and InOutState = 0
		and ApplyOpID = @OpID and ApplyOfficeID = @OfficeID
	
	if @@ROWCOUNT = 0 or @@ERROR <> 0
	begin
		raiserror('药品出入库：业务提交失败，请刷新核对', 16, 1)
		goto ErrorProcess
	end
	
	--如果是内部业务，则修改申请科室的库存
	if @NewState = 10
	begin
		exec @ReturnValue = Pro_Med_InOut_UpdateStock @InOutID, @OpID, @OfficeID, @InOutSign
				
		if @ReturnValue <> 0
			goto ErrorProcess
			
		--自动同步供应商
		if RTRIM(@SupplyName) <> ''
		begin
			update His_Base.dbo.Base_FeeInfo
			set SupplyName = @SupplyName
			where FeeID in (
				select FeeID
				from Med_InOutDetail
				where InOutID = @InOutID)
			
			if @ReturnValue <> 0
				goto ErrorProcess
		end	
	end	

	commit tran
	return 0

ErrorProcess:
	rollback tran
	return 1
	
END
GO


