-- ----------------------------
-- Procedure structure for Pro_Med_InOut_UpdateStock
-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[Pro_Med_InOut_UpdateStock]') AND type IN ('P', 'PC', 'RF', 'X'))
	DROP PROCEDURE[dbo].[Pro_Med_InOut_UpdateStock]
GO

CREATE PROCEDURE [dbo].[Pro_Med_InOut_UpdateStock]
	@InOutID varchar(12),
	@OpID varchar(8),
	@OfficeID varchar(8),
	@InOutSign int
as
BEGIN
	declare @LastCount int, 
	@LastError int,
	@NotExistFeeName varchar(300),
	@OfficeUse varchar(8)

	--判断科室是否为药库、药房，非药品管理科室没有库存
	select @OfficeUse = isnull(OfficeUse, '') 
	from His_Sys.dbo.Sys_Office 
	where OfficeID = @OfficeID
	
	if @OfficeUse not in ('410', '420', '430')
	begin
		return 0
	end
	
	begin tran	
	
	--修改库存防死锁语句：锁定相同记录，达到排队效果。
	--不同科室之间库存操作不会产生死锁
	update His_Sys.dbo.Sys_Office
	set OrderID = OrderID
	where OfficeID = @OfficeID
	
	if @@ERROR <> 0 or @@ROWCOUNT = 0
	begin
		raiserror('药品出入库：排队机制失败。', 16, 1)
		goto ErrorProcess
	end
	
	--自动添加缺少的库存项目，添加之后可省略后面的库存项目判断
	insert into Med_Stock (OfficeID, FeeID, StopSign)
	select @OfficeID, FeeID, 1
	from Med_InOutDetail
	where InOutID = @InOutID 
		and FeeID not in (select FeeID from Med_Stock where OfficeID = @OfficeID)
	
	declare @DetailID int,
		@FeeID int,
		@Quan numeric(18, 3),
		@SumPrice numeric(18, 2)
	
	declare DetailCursor cursor for 
	select DetailID, FeeID, Quan, SumPrice 
	from Med_InOutDetail 
	where InOutID = @InOutID
	for read only
		
	open DetailCursor	
	fetch next from DetailCursor into @DetailID, @FeeID, @Quan, @SumPrice
	
	while @@FETCH_STATUS = 0
	begin
		--判断出入库标志
		if @InOutSign = 1 
		begin
			-- 修改入库数量和当前数量
			update Med_Stock
			set InQuan = InQuan + @Quan,
				InPrice = InPrice + @SumPrice,
				CurQuan = CurQuan + @Quan,
				CurPrice = CurPrice + @SumPrice
			where OfficeID = @OfficeID and FeeID = @FeeID
		end
		else begin
			--修改出库数量和当前数量
			update Med_Stock
			set OutQuan = OutQuan + @Quan,
				OutPrice = OutPrice + @SumPrice,
				CurQuan = CurQuan - @Quan,
				CurPrice = CurPrice - @SumPrice
			where OfficeID = @OfficeID and FeeID = @FeeID
		end
		
		--记录当前库存
		if @OfficeUse = '410'
			update Med_InOutDetail
			set StockQuan = a.LastQuan + a.InQuan - a.OutQuan
			from Med_Stock a
			where a.OfficeID = @OfficeID and a.FeeID = @FeeID
				and Med_InOutDetail.DetailID = @DetailID
				
		--修改西药库当前库存
		if @OfficeID = '031801'
			update Med_InOutDetail
			set StockQuan = a.LastQuan + a.InQuan - a.OutQuan
			from Med_Stock a, Med_InOutDetail b
			where b.DetailID = @DetailID and a.OfficeID = @OfficeID and a.FeeID = b.FeeID
		
		fetch next from DetailCursor
		into @DetailID, @FeeID, @Quan, @SumPrice
	end

	close DetailCursor
	deallocate DetailCursor
		
	--药库不允许出现负库存
	if @OfficeUse = '410'
		and exists(select b.FeeID
			from Med_Stock b, Med_InOutDetail a
			where a.InOutID = @InOutID
				and b.OfficeID = @OfficeID
				and a.FeeID = b.FeeID
				and b.LastQuan + b.InQuan - b.OutQuan < 0)
	begin
		raiserror('药品出入库：出现负库存，请刷新核对', 16, 1)
		goto ErrorProcess
	end

	commit tran
	return 0

ErrorProcess:
	rollback tran
	return 1
	
END
GO


-- ----------------------------
-- Procedure structure for Pro_Med_InOutDetail_Query
-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[Pro_Med_InOutDetail_Query]') AND type IN ('P', 'PC', 'RF', 'X'))
	DROP PROCEDURE[dbo].[Pro_Med_InOutDetail_Query]
GO

CREATE PROCEDURE [dbo].[Pro_Med_InOutDetail_Query]
	@InOutID varchar(12),  --单号
	@OfficeID varchar(8),  --科室
	@OpID varchar(8)
as
BEGIN
	declare @ApplyOfficeID varchar(8),
		@InOutState int 
		
	select @ApplyOfficeID = ApplyOfficeID,
		@InOutState = InOutState
	from Med_InOutMaster 
	where InOutID = @InOutID
	
	--执行科室可以看到库存
	if @ApplyOfficeID = @OfficeID
		SELECT DetailID, InOutID, FeeID, FeeName, Specs, Unit, FactoryName, StatTypeID,
			StatType, Price, PlanQuan, Quan, 0.00 as StockQuan, 
			0.00 as StockQuanDiff, 
			Quan - PlanQuan as QuanDiff,
			SumPrice,
			InPrice, InvoiceCode, InvoiceDate, Batch, DisableDate, Memo
		FROM Med_InOutDetail
		WHERE InOutID = @InOutID
		order by DetailID
	else
		SELECT DetailID, InOutID, a.FeeID, FeeName, Specs, Unit, FactoryName, StatTypeID,
			StatType, Price, PlanQuan, Quan, 
			case when @InOutState = 10 then a.StockQuan else b.LastQuan + b.InQuan - b.OutQuan end as StockQuan,
			case when @InOutState = 10 then 0 else b.LastQuan + b.InQuan - b.OutQuan - a.Quan end as StockQuanDiff,
			Quan - PlanQuan as QuanDiff, 
			SumPrice,
			a.InPrice, InvoiceCode, InvoiceDate, [Batch], [DisableDate], a.Memo
		FROM Med_InOutDetail a left join Med_Stock  b on b.OfficeID = @OfficeID and a.FeeID = b.FeeID
		WHERE InOutID = @InOutID 
		order by DetailID

END
GO


-- ----------------------------
-- Procedure structure for Pro_Med_InOut_Accept
-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[Pro_Med_InOut_Accept]') AND type IN ('P', 'PC', 'RF', 'X'))
	DROP PROCEDURE[dbo].[Pro_Med_InOut_Accept]
GO

CREATE PROCEDURE [dbo].[Pro_Med_InOut_Accept]
	@InOutID varchar(12),  --单号
	@OpID varchar(8),  --接收人
	@OfficeID varchar(8)  --接收科室
as
BEGIN

/*********************************************************************
	出入库业务状态：
	0  正在申请（正在录入编辑）
	1  确认申请（录入完成确认）
	10 完成（或者接收单位已执行）
*********************************************************************/

	declare @ReturnValue int,
	@InOutSign int,
	@ApplyOfficeID varchar(8),
	@SupplyName varchar(100)

	begin tran
	
	--修改出入库状态志, 只能由接收科室进行操作
	update Med_InOutMaster
	set InOutState = 10, AcceptOpID = @OpID, AcceptTime = GETDATE()
	where InOutID = @InOutID and AcceptOfficeID = @OfficeID and InOutState = 1
	
	if @@ROWCOUNT = 0 or @@ERROR <> 0
	begin
		raiserror('药品出入库：业务接收失败，请刷新核对(%s)', 16, 1, @InOutID)
		goto ErrorProcess
	end
	
	--读取出入库标识、申请科室
	select @InOutSign = InOutSign, 
		@ApplyOfficeID = ApplyOfficeID,
		@SupplyName = isnull(SupplyName, '')
	from Med_InOutMaster
	where InOutID = @InOutID
	
	--自动同步供应商
	if RTRIM(@SupplyName) <> '' and @ApplyOfficeID = @OfficeID
	begin
		update His_Base.dbo.Base_FeeInfo
		set SupplyName = @SupplyName
		where FeeID in (
			select FeeID
			from Med_InOutDetail
			where InOutID = @InOutID 
		)
		
		if @ReturnValue <> 0
			goto ErrorProcess
	end		
	
	--修改申请科室的库存，和下面的库存操作可交换顺序，因为不存在相互申请的业务
	exec @ReturnValue = Pro_Med_InOut_UpdateStock @InOutID, @OpID, @ApplyOfficeID, @InOutSign	
	if @ReturnValue <> 0
		goto ErrorProcess
	
	--接收科室的出入库标识与申请科室相反
	set @InOutSign = -@InOutSign 
	
	--修改接收科室的库存
	exec @ReturnValue = Pro_Med_InOut_UpdateStock @InOutID, @OpID, @OfficeID, @InOutSign	
	if @ReturnValue <> 0
		goto ErrorProcess

	commit tran
	return 0

ErrorProcess:
	rollback tran
	return 1
	
END
GO


-- ----------------------------
-- Procedure structure for Pro_Med_Stock_SnapBatch
-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[Pro_Med_Stock_SnapBatch]') AND type IN ('P', 'PC', 'RF', 'X'))
	DROP PROCEDURE[dbo].[Pro_Med_Stock_SnapBatch]
GO

CREATE PROCEDURE [dbo].[Pro_Med_Stock_SnapBatch]
	@OfficeID varchar(8),
	@OpID varchar(8),
	@CheckID int,
	@LastCheckID int
as
BEGIN
/*
	1 导入库存快照期间产生的入库数据到库存批次表中
	1.2 导入上次结转的批次
	2 批次库存清零
	3 检查每种药品
	3.1 获取药品的库存、按入库时间排倒序的批次库存
	3.2 分配库存到每个批次的当前库存
	3.3 剩余数量时自动生成一个批次库存
	3.4 删除库存为0的批次

*/
	declare 
	@LastCheckTime datetime,
	@CurCheckTime datetime
	
	if @OfficeID <> '031801' 
		return 0

	select @LastCheckTime = isnull(CheckTime, GETDATE() - 366)
	from Med_CheckMaster
	where CheckID = @LastCheckID
	
	select @CurCheckTime = isnull(CheckTime, GETDATE())
	from Med_CheckMaster
	where CheckID = @CheckID
	
	begin tran

	--锁定科室
	update His_Sys.dbo.Sys_Office
	set OrderID = OrderID
	where OfficeID = @OfficeID
	
	--清空结转批次，从而可反复调用此过程
	delete Med_CheckBatch
	where CheckID = @CheckID
	
	--1 导入这段时间入库批次
	insert into Med_CheckBatch (CheckID, FeeID, 
		InTime, InQuan, CurQuan, Batch, DisableDate, InOutID)
	select @CheckID, b.FeeID, 
		a.AcceptTime, b.Quan, 0, b.Batch, b.DisableDate, a.InOutID
	from Med_InOutMaster a inner join Med_InOutDetail b on a.InOutID = b.InOutID
	where a.AcceptTime > @LastCheckTime 
		and a.AcceptTime <= @CurCheckTime 
		and a.InOutState = 10
		and a.ApplyOfficeID = @OfficeID and a.InOutSign = 1 
		and b.Quan > 0 and isnull(b.Batch, '') <> ''
	
	if @@ERROR <> 0
		goto ErrorProcess
		
	--1.2 导入上次结转批次 
	insert into Med_CheckBatch (CheckID, FeeID, 
		InTime, InQuan, CurQuan, Batch, DisableDate, InOutID)
	select @CheckID, FeeID, 
		InTime, InQuan, 0, Batch, DisableDate, InOutID
	from Med_CheckBatch
	where CheckID = @LastCheckID
	
	if @@ERROR <> 0
		goto ErrorProcess
		
	--2 批次库存清零，已经是0
	--update Med_CheckBatch
	--set CurQuan = 0
	--where CheckID = @CheckID	

	--3 检查每种药品
	declare @FeeID int,
		@StockQuan numeric(18, 3),
		@BatchID int,
		@BatchQuan numeric(18, 3)
		
		
	---3.1 获取结转信息中的库存，从而可反复调用此过程
	declare StockCursor cursor for 
	select FeeID, CurQuan
	from Med_CheckDetail
	where CheckID = @CheckID and CurQuan > 0
	
	--3.1 第2种选择方案，获取药品的库存？
	--declare StockCursor cursor for 
	--select FeeID, LastQuan + InQuan - OutQuan
	--from Med_Stock
	--where OfficeID = @OfficeID and StopSign = 0
	--	and LastQuan + InQuan - OutQuan > 0
		
	open StockCursor	
	fetch next from StockCursor into @FeeID, @StockQuan
	
	while @@FETCH_STATUS = 0
	begin
		--3.1 获取按入库时间倒序的批次库存
		declare BatchCursor cursor for
			select BatchID, InQuan
			from Med_CheckBatch
			where CheckID = @CheckID
				and FeeID = @FeeID
			order by InTime desc
				
		open BatchCursor
		fetch next from BatchCursor into @BatchID, @BatchQuan
	
		while @@FETCH_STATUS = 0 and @StockQuan > 0
		begin
			
			update Med_CheckBatch
			set CurQuan = case 
				when @StockQuan >= @BatchQuan then @BatchQuan
				else @StockQuan end
			where BatchID = @BatchID
		
			select @StockQuan = @StockQuan - @BatchQuan
		
			fetch next from BatchCursor into @BatchID, @BatchQuan
		end
		
		close BatchCursor
		deallocate BatchCursor
		
		--3.3 剩余数量时自动生成一个批次库存，默认入库时间是三个月前，有效期一年
		if @StockQuan > 0
			insert into Med_CheckBatch (CheckID, FeeID, InTime, 
				InQuan, CurQuan, Batch, DisableDate, InOutID)
			select @CheckID, @FeeID, GETDATE() - 90, 
				@StockQuan, @StockQuan, 'xxxxxx', GETDATE() + 365, ''	
		
		fetch next from StockCursor into @FeeID, @StockQuan
	end

	close StockCursor
	deallocate StockCursor

	--3.4 删除库存为0的批次
	delete Med_CheckBatch
	where CheckID = @CheckID and CurQuan <= 0
	
	commit tran
	return 0

ErrorProcess:
	rollback tran
	return 1
	
END
GO


-- ----------------------------
-- Procedure structure for Pro_Med_InOut_Stat_Detail
-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[Pro_Med_InOut_Stat_Detail]') AND type IN ('P', 'PC', 'RF', 'X'))
	DROP PROCEDURE[dbo].[Pro_Med_InOut_Stat_Detail]
GO

CREATE PROCEDURE [dbo].[Pro_Med_InOut_Stat_Detail]
	@BeginDate smalldatetime,
	@EndDate smalldatetime,
	@OfficeID varchar(8),
	@OpID varchar(8)
AS
begin
	declare @PowerFlag int
	
	select @PowerFlag = His_Sys.dbo.Fun_HavePower(@OpID, @OfficeID, '7005')
	
	if DATEDIFF(day, @BeginDate, @EndDate) > 31 
	begin
		raiserror('出入库明细查询：查询时间段不能查过一个月', 16, 1)
		return 0
	end

	--InOutSign对应申请科室，接收科室相反
	--只有药剂科显示库存信息	
	select top 10000 b.DetailID,
		a.AcceptTime, a.InOutID,
		case when a.ApplyOfficeID = @OfficeID then 1 else -1 end  * a.InOutSign as InOutSign, 
		a.InOutTypeID, a.InOutName, a.ApplyOfficeID, a.ApplyOfficeName, a.AcceptOfficeID, a.AcceptOfficeName, 
		b.FeeID, b.FeeName, 
		c.ShapeName, c.SpecialSign, b.StatType, b.StatTypeID,
		b.Specs, b.Unit, b.Price,
		case when a.ApplyOfficeID = @OfficeID then 1 else -1 end  * a.InOutSign * b.Quan as Quan, 
		case when a.ApplyOfficeID = @OfficeID then 1 else -1 end  * a.InOutSign * b.SumPrice as SumPrice,
		case when @OfficeID = '031801' then b.StockQuan else 0.00 end as StockQuan,
		b.PlanQuan, b.InPrice, 
		c.IME_PY, b.Batch, b.DisableDate, c.BaseSign,
		case when a.InvoiceDate is null then b.InvoiceDate else a.InvoiceDate end as InvoiceDate,
		case when isnull(a.InvoiceCode, '') = '' then b.InvoiceCode else a.InvoiceCode end as InvoiceCode,
		b.FactoryName, 
		case when @OfficeID = '031801' then a.SupplyName else '' end as SupplyName,
		a.Memo, b.Memo as DetailMemo
	from Med_InOutMaster a 
		inner join Med_InOutDetail b on a.InOutID = b.InOutID
		left join His_Base.dbo.Base_FeeInfo c on b.FeeID = c.FeeID
	where a.InOutState = 10 and a.AcceptTime >= @BeginDate and a.AcceptTime < @EndDate + 1
		and (@PowerFlag <> 0 or ApplyOfficeID = @OfficeID or AcceptOfficeID = @OfficeID)
		
	
	
	
end
GO


-- ----------------------------
-- Function structure for Fun_GetAgeText
-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[Fun_GetAgeText]') AND type IN ('FN', 'FS', 'FT', 'IF', 'TF'))
	DROP FUNCTION[dbo].[Fun_GetAgeText]
GO

CREATE FUNCTION [dbo].[Fun_GetAgeText](
	@YearAge int, 
	@MonthAge int, 
	@DayAge int)
returns varchar(15)
AS
BEGIN
	if @YearAge >= 3
		select @MonthAge = 0, @DayAge = 0
		
	if @YearAge >= 1
		set @DayAge = 0
	
	return 
		case when @YearAge > 0 then cast(@YearAge as varchar(3)) + '岁' else '' end
		+ case when @MonthAge > 0 then cast(@MonthAge as varchar(3)) + '月' else '' end
		+ case when @DayAge > 0 then cast(@DayAge as varchar(3)) + '天' else '' end


END
GO


