CREATE PROCEDURE [dbo].[Pro_Fee_Balance_Check]
	@BalanceID int,
	@OpID varchar(8)
AS
	begin tran
	
	-- 新增结算记录
	update Fee_Balance
	set CheckSign = 1, CheckOpID = @OpID, CheckTime = GETDATE()
	where BalanceID = @BalanceID and CheckSign = 0

	if @@Error <> 0 or @@ROWCOUNT = 0
	begin
		raiserror('财务结算：修改结算审核标志失败.', 16, 1)
		goto ErrorProcess
	end

	commit tran	
	return 0

ErrorProcess:
	rollback tran
	return 1
GO


-- ----------------------------
-- Procedure structure for Pro_Fee_Balance_Cancel
-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[Pro_Fee_Balance_Cancel]') AND type IN ('P', 'PC', 'RF', 'X'))
	DROP PROCEDURE[dbo].[Pro_Fee_Balance_Cancel]
GO

CREATE PROCEDURE [dbo].[Pro_Fee_Balance_Cancel] 
	@BalanceID int,
	@OpID varchar(8)
AS
	declare @ErrorNum int, 
	@UpdateCount int,
	@BalanceTypeID int
		
	begin tran
	
	raiserror('财务结算：不允许取消结算申请记录.', 16, 1)
	goto ErrorProcess
	
	--获取结算类型
	select @BalanceTypeID = BalanceTypeID
	from Fee_Balance
	where BalanceID = @BalanceID
	
	--删除未审核的结算申请
	delete Fee_Balance
	where BalanceID = @BalanceID and CheckSign = 0 and BalanceOpID = @OpID

	select @ErrorNum = @@error, @UpdateCount = @@rowcount
	
	if @ErrorNum <> 0
		goto ErrorProcess
	
	if @UpdateCount = 0
	begin
		raiserror('财务结算：未找到结算申请记录.', 16, 1)
		goto ErrorProcess
	end
	
	--获取结算类型
	select @BalanceTypeID = BalanceTypeID
	from Fee_Balance
	where BalanceID = @BalanceID

	--根据结算类型采取相应动作
	if @BalanceTypeID = 0
		--取消挂号结算标识
		update Clin_Reg
		set BalanceID = 0
		where BalanceID = @BalanceID
	else if @BalanceTypeID = 1
		update Clin_FeeMaster
		set BalanceID = 0 
		where BalanceID = @BalanceID
	else if @BalanceTypeID = 2
		update His_Hosp.dbo.Hosp_Payment
		set BalanceID = 0 
		where BalanceID = @BalanceID
	else 
		update His_Hosp.dbo.Hosp_FeeMaster
		set BalanceID = 0 
		where BalanceID = @BalanceID

	if @@error <> 0
		goto ErrorProcess

	commit tran
	return 0

ErrorProcess:
	Rollback Tran
	Return 1
GO


-- ----------------------------
-- Procedure structure for Pro_Clin_Fee_CalcReturnDiscount
-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[Pro_Clin_Fee_CalcReturnDiscount]') AND type IN ('P', 'PC', 'RF', 'X'))
	DROP PROCEDURE[dbo].[Pro_Clin_Fee_CalcReturnDiscount]
GO

CREATE PROCEDURE [dbo].[Pro_Clin_Fee_CalcReturnDiscount]
	@ClinFeeID varchar(12), --发票号码
	@DiscountMoney varchar(18) output --总金额
AS
BEGIN
	declare	@SumPrice2 numeric(18, 2)
	declare	@Discount2 numeric(18, 2) = 0,
		@UnitID varchar(20) = ''

	-- 计算退费总额
    select @SumPrice2 = isnull(sum(cast(ReturnQuan * CPrice as numeric(18, 2))), 0)
	from Clin_RecMaster inner join Clin_RecDetail on Clin_RecMaster.RecipeID = Clin_RecDetail.RecipeID
	where (ClinFeeID = @ClinFeeID)
	
	-- 获取原始优惠金额
	select @Discount2 = DiscountMoney
	from Clin_FeeMaster
	where (ClinFeeID = @ClinFeeID)
	
	if @Discount2 > 0 
	begin
		--获取协议单位
		select @UnitID = isnull(b.UnitID, '')
		from Clin_Reg a, Clin_Patient b
		where a.ClinID = (select ClinID from Clin_FeeMaster where ClinFeeID = @ClinFeeID)
			and a.PID = b.PID

		select @Discount2 = isnull(SUM(c.StatSumPrice * a.Discount), 0)
		from His_Base.dbo.d_AgreementDiscount a inner join
			(select StatTypeID, SUM(cast(ReturnQuan * CPrice as numeric(18,2))) as StatSumPrice
			from Clin_RecMaster inner join Clin_RecDetail on Clin_RecMaster.RecipeID = Clin_RecDetail.RecipeID
			where Clin_RecMaster.ClinFeeID = @ClinFeeID
			group by StatTypeID) c on a.StatTypeID = c.StatTypeID
		where a.UnitID = @UnitID
	end
	
	set @DiscountMoney = @Discount2
END
GO


-- ----------------------------
-- Procedure structure for Pro_Clin_Reg
-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[Pro_Clin_Reg]') AND type IN ('P', 'PC', 'RF', 'X'))
	DROP PROCEDURE[dbo].[Pro_Clin_Reg]
GO

CREATE PROCEDURE [dbo].[Pro_Clin_Reg]
	@ClinID      varchar(12) output,
	@OpID        varchar(8),
	@Xml	 xml
AS
	declare @ReturnValue int,
	@XmlDoc int = 0,
	@PatientName varchar(30),
	@Sex varchar(8),
	@Age int,
	@MonthAge int,
	@DayAge int,
	@Birthday smalldatetime,
	@IDCode varchar(20) = '',
	@OfficeID    varchar(8),
	@OfficeName  varchar(40),
	@DoctorID    varchar(8) = '',
	@RegTypeID   int,
	@RegType     varchar(20) = '',
	@RegPrice    numeric(18,2),
	@DiagPrice   numeric(18,2),
	@CasePrice   numeric(18,2) = 0,
	@SumPrice    numeric(18,2),
	@PatientID   int = 0,
	@UnitID      varchar(8),
	@OpName varchar(20),
	@Remark varchar(50)
	
	select @OpName = OpName
	from His_Sys.dbo.Sys_Op
	where OpID = @OpID
	
	begin tran
	
	--准备XML文档
	exec sp_xml_preparedocument @XmlDoc output, @Xml

	select @PatientName = PatientName, @Sex = Sex, @Age = isnull(Age, 0), 
		@MonthAge = ISNULL(MonthAge, 0), @DayAge = isnull(DayAge, 0),	@IDCode = IDCode,
		@OfficeID = OfficeID, @OfficeName = OfficeName, @RegTypeID = RegTypeID, @RegType = RegType,
		@RegPrice = RegPrice, @DiagPrice = DiagPrice, @SumPrice = SumPrice,
		@UnitID = UnitID, @Remark = Remark
	from openxml (@XmlDoc, '/XMLData/Datasets/Clin_Reg_Help/Row', 0) with 
		(PatientName varchar(30),
		Sex varchar(6),
		Age int,
		MonthAge int,
		DayAge int,
		IDCode varchar(20),
		OfficeID varchar(8),
		OfficeName varchar(40),
		RegTypeID varchar(8),
		RegType varchar(20),
		RegPrice numeric(18, 2),
		DiagPrice numeric(18, 2),
		SumPrice numeric(18, 2),
		UnitID varchar(8),
		Remark varchar(50))

	if @@ERROR <> 0
		goto ErrorProcess

	--释放XML文档
	exec sp_xml_removedocument @XmlDoc
	
-- 	declare @result varchar(800)
-- 	set @result = '门诊挂号：' + @PatientName + ' Sex:' + @Sex;

-- 	raiserror(@result, 16, 1)
-- 	goto ErrorProcess
		
	if ltrim(@PatientName) = '' or LTRIM(@Sex) = ''
	begin
		raiserror('门诊挂号：请输入姓名和性别', 16, 1)
		goto ErrorProcess
	end
	
	if @Sex not in ('男', '女')
	begin
		raiserror('门诊挂号：性别只能输入男和女', 16, 1)
		goto ErrorProcess
	end
	
	--年份转换为年龄
	if @Age > 1000
	begin
		set @Age = datepart(year, getdate()) - @Age
	end
	
	if @Age < 0 or @Age > 200
	begin
		raiserror('门诊挂号：年龄要大于等于0，小于200', 16, 1)
		goto ErrorProcess
	end
	
	if @MonthAge < 0 or @MonthAge > 11
	begin
		raiserror('门诊挂号：月龄要大于等于0，小于12', 16, 1)
		goto ErrorProcess
	end
	
	if @DayAge < 0 or @DayAge > 29
	begin
		raiserror('门诊挂号：天数要大于等于0，小于30', 16, 1)
		goto ErrorProcess
	end
	
	if @Age = 0 and @MonthAge = 0 and @DayAge = 0
	begin
		raiserror('门诊挂号：年龄、月龄、天数不能都为0', 16, 1)
		goto ErrorProcess
	end
	
	if @OfficeID = ''
	begin
		raiserror('门诊挂号：请输入科室', 16, 1)
		goto ErrorProcess
	end
	
	if @RegTypeID = 0
	begin
		raiserror('门诊挂号：请输入挂号类别', 16, 1)
		goto ErrorProcess
	end
	
	if @IDCode <> '' 
		set @Birthday = convert(smalldatetime, substring(@IDCode, 7, 8), 112)
	else
		set @Birthday = dateadd(day, -@DayAge, dateadd(
			month, -@MonthAge, dateadd(
			year, -@Age, getdate())))

	if @@error <> 0
		goto ErrorProcess
	
	--获取门诊号
	exec @ReturnValue = Pro_Clin_Reg_GetID @ClinID output
  
	if @ReturnValue <> 0
		goto ErrorProcess
		
	--新建基本信息
	exec @ReturnValue = Pro_Clin_Patient_Add 
		@PatientID = @PatientID output,
		@PatientName = @PatientName,
		@Sex = @Sex,
		@Birthday = @Birthday,
		@IDCode = @IDCode,
		@Nation = '',
		@Address = '',
		@UnitID = @UnitID,
		@OpID = @OpID
	
	if @ReturnValue <> 0
		goto ErrorProcess		
	
	select @SumPrice = @RegPrice + @DiagPrice + @CasePrice
	
	insert into Clin_Reg
		(ClinID, RegTypeID, ClinDoctorID, ClinOfficeID, ClinOfficeName, 
		PID, OpID, OpName, RegType,
		RegPrice, DiagPrice, CasePrice, SumPrice, RegSign, 
		PatientName, Sex, Age, MonthAge, DayAge, Memo) 
	values(@ClinID, @RegTypeID, @DoctorID, @OfficeID, @OfficeName, 
		@PatientID, @OpID, @OpName, @RegType,
		@RegPrice, @DiagPrice, @CasePrice, @SumPrice, 0, 
		@PatientName, @Sex, @Age, @MonthAge, @DayAge, @Remark)
 
	if @@error <> 0
		goto ErrorProcess
           
	commit tran
	return 0

ErrorProcess:
	rollback tran
	return 1
GO


-- ----------------------------
-- Procedure structure for Pro_Med_InOut_CancelApply
-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[Pro_Med_InOut_CancelApply]') AND type IN ('P', 'PC', 'RF', 'X'))
	DROP PROCEDURE[dbo].[Pro_Med_InOut_CancelApply]
GO

CREATE PROCEDURE [dbo].[Pro_Med_InOut_CancelApply]
	@InOutID varchar(12),  --单号
	@OpID varchar(8),  --操作员
	@OfficeID varchar(8),  --操作员科室
	@NewState int output  --取消后申请单的状态
as
BEGIN

/*********************************************************************
	出入库业务状态：
	0  正在申请（正在录入编辑）
	1  确认申请（录入完成确认）
	10 完成（或者接收单位已执行）
*********************************************************************/

	begin tran
	
	set @NewState = 0
		
	--修改出入库状态标志为编辑中
	update Med_InOutMaster
	set InOutState = 0
	where InOutID = @InOutID and InOutState = 1
	
	if @@ROWCOUNT = 0 or @@ERROR <> 0
	begin
		raiserror('业务状态修改失败，请刷新核对.', 16, 1)
		goto ErrorProcess
	end

	commit tran
	return 0

ErrorProcess:
	rollback tran
	return 1
	
END
GO


-- ----------------------------
-- Procedure structure for Pro_Med_Stock_Snap
-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[Pro_Med_Stock_Snap]') AND type IN ('P', 'PC', 'RF', 'X'))
	DROP PROCEDURE[dbo].[Pro_Med_Stock_Snap]
GO

CREATE PROCEDURE [dbo].[Pro_Med_Stock_Snap]
	@OfficeID varchar(8),
	@OpID varchar(8),
	@Param varchar(20),
	@CheckID int output
as
BEGIN
	declare @OfficeUse varchar(8),
		@OfficeName varchar(30),
		@ReturnValue int,
		@LastCheckID int,
		@CurCheckTime datetime = GETDATE()
	
	select @OfficeUse = OfficeUse,
		@OfficeName = OfficeName
	from His_Sys.dbo.Sys_Office
	where OfficeID = @OfficeID
	
	begin tran

	--锁定科室
	update His_Sys.dbo.Sys_Office
	set OrderID = OrderID
	where OfficeID = @OfficeID
	
	select @LastCheckID = isnull(MAX(CheckID), 0)
	from Med_CheckMaster
	where OfficeID = @OfficeID
	
	--插入结转主表
	insert into Med_CheckMaster (OfficeID, OfficeName, CheckTime, OpID)
	values (@OfficeID, @OfficeName, @CurCheckTime, @OpID)
	
	if @@ERROR <> 0
	begin
		--raiserror('库存结转：', 16, 1)
		goto ErrorProcess
	end
	
	select @CheckID = @@IDENTITY
	
	--插入结转明细
	insert into Med_CheckDetail(CheckID, FeeID, FeeName, Specs, Unit
		,FactoryName, SupplyName, InPrice
		,StatTypeID, StatType
		,LastQuan, LastPrice
		,InQuan, InMoney
		,OutQuan, OutMoney
		,CurQuan, CurPrice
		,PlanQuan)
	select @CheckID, a.FeeID, b.FeeName, b.Specs, b.Unit,
		b.FactoryName, 
		case when @OfficeUse = '410' then b.SupplyName else '' end, --药库记录采购商
		b.InPrice,
		b.StatTypeID, b.StatType,
		a.LastQuan, a.LastPrice,
		a.InQuan, a.InPrice,
		a.OutQuan, a.OutPrice,
		a.LastQuan + a.InQuan - a.OutQuan, b.Price,
		case when a.OutQuan - (a.LastQuan + a.InQuan - a.OutQuan) > 0 
			then a.OutQuan - (a.LastQuan + a.InQuan - a.OutQuan)
			else 0
		end
	from Med_Stock a inner join His_Base.dbo.Base_FeeInfo b on a.FeeID = b.FeeID
	where OfficeID = @OfficeID
	
	if @@ERROR <> 0
	begin
		--raiserror('库存结转：', 16, 1)
		goto ErrorProcess
	end

	--结转库存
	update Med_Stock
	set LastQuan = LastQuan + InQuan - OutQuan,
		LastPrice = b.Price,
		InQuan = 0, InPrice = 0,
		OutQuan = 0, OutPrice = 0,
		CurQuan = LastQuan, CurPrice = b.Price
	from Med_Stock a inner join His_Base.dbo.Base_FeeInfo b on a.FeeID = b.FeeID
	where a.OfficeID = @OfficeID
	
	if @@ERROR <> 0
	begin
		--raiserror('库存结转：', 16, 1)
		goto ErrorProcess
	end
	
	--修改接收科室的库存
	exec @ReturnValue = Pro_Med_Stock_SnapBatch
		@OfficeID = @OfficeID,
		@OpID = @OpID,
		@CheckID = @CheckID,
		@LastCheckID = @LastCheckID
		
	if @ReturnValue <> 0
		goto ErrorProcess

	commit tran
	return 0

ErrorProcess:
	rollback tran
	return 1
	
END
GO


-- ----------------------------
-- Function structure for Fun_DelimitedTextToTable
-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[Fun_DelimitedTextToTable]') AND type IN ('FN', 'FS', 'FT', 'IF', 'TF'))
	DROP FUNCTION[dbo].[Fun_DelimitedTextToTable]
GO

CREATE FUNCTION [dbo].[Fun_DelimitedTextToTable](
	@DelimitedText varchar(8000),  --分隔符分隔的文本，中文同样有效
	@Delimiter varchar(4) = ',' --分隔符
) 
returns @List table (Item varchar(100))
begin
	declare @Item varchar(100), @CurIndex int = 0, @LastIndex int = 1

	while 1=1
	begin
		set @CurIndex = charindex(@Delimiter, @DelimitedText, @LastIndex)
		
		if @CurIndex <> 0
		begin
			select @Item = substring(@DelimitedText, @LastIndex, @CurIndex - @LastIndex),	
				@LastIndex = @CurIndex + 1 --移动到下一个位置
				
			insert into @List select @Item
		end
		else begin
			if @LastIndex <= len(@DelimitedText)
			begin
				--插入最后一项
				select @Item = substring(@DelimitedText, @LastIndex, len(@DelimitedText) - @LastIndex + 1)
				insert into @List select @Item
			end
			
			break
		end
	end
		
	return
end
GO


-- ----------------------------
-- Procedure structure for Pro_Med_InOut_Stat_Office
-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[Pro_Med_InOut_Stat_Office]') AND type IN ('P', 'PC', 'RF', 'X'))
	DROP PROCEDURE[dbo].[Pro_Med_InOut_Stat_Office]
GO

CREATE PROCEDURE [dbo].[Pro_Med_InOut_Stat_Office]
	@BeginDate smalldatetime,
	@EndDate smalldatetime,
	@OfficeID varchar(8),
	@OpID varchar(8)
AS
begin
	
	if DATEDIFF(day, @BeginDate, @EndDate) > 31 
	begin
		raiserror('出入库统计：查询时间段不能查过一个月', 16, 1)
		return 0
	end
	
	declare @PowerFlag int
	
	select @PowerFlag = His_Sys.dbo.Fun_HavePower(@OpID, @OfficeID, '7005')

	--select a.AcceptOfficeID, a.AcceptOfficeName,
	--	a.ApplyOfficeID, a.ApplyOfficeName, ShapeName,
	--	left(b.StatTypeID, 4) as StatTypeID, d.StatTypeName as StatType,
	--	SUM(a.InOutSign * b.SumPrice) as SumPrice
	--from Med_InOutMaster  a
	--	inner join Med_InOutDetail  b on a.InOutID = b.InOutID
	--	left join His_Base.dbo.Base_StatType  d on d.StatTypeID = left(b.StatTypeID, 4)
	--where a.InOutState = 10 and a.AcceptTime >= @BeginDate 
	--	and a.AcceptTime < @EndDate + 1 
	--	and AcceptOfficeID <> ''
	--	and (AcceptOfficeID = @OfficeID
	--		or ApplyOfficeID = @OfficeID
	--		or @PowerFlag <> 0)
	--group by a.AcceptOfficeID, a.AcceptOfficeName, a.ApplyOfficeID, a.ApplyOfficeName, 
	--	ShapeName, left(b.StatTypeID, 4), d.StatTypeName

	select a.AcceptOfficeID, a.AcceptOfficeName,
		a.ApplyOfficeID, a.ApplyOfficeName, '' as ShapeName,
		left(b.StatTypeID, 4) as StatTypeID, d.StatTypeName as StatType,
		SUM(a.InOutSign * b.SumPrice) as SumPrice,
		sum(case when b.ShapeName = '大输液' then a.InOutSign * b.SumPrice else 0 end) as PartPrice1,
		sum(case when b.ShapeName = '敷料' then a.InOutSign * b.SumPrice else 0 end) as PartPrice2
	from Med_InOutMaster  a
		inner join Med_InOutDetail  b on a.InOutID = b.InOutID
		left join His_Base.dbo.Base_StatType  d on d.StatTypeID = left(b.StatTypeID, 4)
	where a.InOutState = 10 and a.AcceptTime >= @BeginDate 
		and a.AcceptTime < @EndDate + 1 
		and AcceptOfficeID <> ''
		and (AcceptOfficeID = @OfficeID
			or ApplyOfficeID = @OfficeID
			or @PowerFlag <> 0)
	group by a.AcceptOfficeID, a.AcceptOfficeName, 
		a.ApplyOfficeID, a.ApplyOfficeName,
		left(b.StatTypeID, 4), d.StatTypeName


end
GO


-- ----------------------------
-- Procedure structure for Pro_Clin_Fee_Take
-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[Pro_Clin_Fee_Take]') AND type IN ('P', 'PC', 'RF', 'X'))
	DROP PROCEDURE[dbo].[Pro_Clin_Fee_Take]
GO

CREATE PROCEDURE [dbo].[Pro_Clin_Fee_Take]
	@ClinFeeID varchar(12) output,
	@ClinID varchar(12), --门诊号
	@RecipeIDList varchar(2000),  --处方列表，形式：101,102,103,104
	@FeeTypeID int,  --收费类型
	@YBID int, --YBID 关联4005,4006...
	@OpID varchar(8), --操作员
	@SumPrice numeric(18,2), --应收
	@YBMoney numeric(18,2), --医保支付
	@CashMoney numeric(18,2), --现金支付
	@DiscountMoney numeric(18,2), --优惠金额
	@POSMoney numeric(18,2),  --POS支付
	@ETCMoney1 numeric(18,2), --其他支付1
	@ETCType1 varchar(50), --其他支付类别1
	@ETCCode1 varchar(50), --其他支付号码1
	@ETCMoney2 numeric(18,2), --其他支付2
	@ETCType2 varchar(50), --其他支付类别2
	@ETCCode2 varchar(50), --其他支付号码2
	@ETCMoney3 numeric(18,2)=0, --其他支付2   未用
	@ETCType3 varchar(50)='', --其他支付类别2   未用
	@ETCCode3 varchar(50)='', --其他支付号码2   未用
	@GetMoney numeric(18, 2), --收款
	@ChargeMoney numeric(18, 2), --找零
	@Memo varchar(50)
AS
	declare @ReturnValue int,
	@FeeSign int = 1, 
	@FeeTime datetime = getdate(),
	@PID int,
	@PatientName varchar(50),
	@SumPrice2 numeric(18,2),
	@SystemCode varchar(20),
	@InterfaceID varchar(20),
	@FeeTypeName varchar(20) = '',
	@ETCName1 varchar(20),
	@ETCName2 varchar(20),
	@OpName varchar(20),
	@DoctorID varchar(8),
	@DoctorName varchar(20),
	@OfficeID varchar(10),
	@OfficeName varchar(30)

	select @OpName = OpName
	from His_Sys.dbo.Sys_Op
	where OpID = @OpID

	--获取收费类型名称
	select @FeeTypeName = FeeType
	from His_Base.dbo.D_FeeType
	where FeeTypeID = @FeeTypeID
	
	--获取支付类型名称
	select @ETCName1 = PayTypeName
	from His_Base.dbo.D_PayType
	where PayTypeID = @ETCType1
	
	select @ETCName2 = PayTypeName
	from His_Base.dbo.D_PayType
	where PayTypeID = @ETCType2
	
	begin tran
	
	select @PID=PID, 
		@PatientName=PatientName,
		@SystemCode = SystemCode, 
		@InterfaceID = InterfaceID
	from Clin_Reg where ClinID = @ClinID
	
	--获取收费发票流水号
	exec @ReturnValue = Pro_Clin_Fee_GetID @ClinFeeID output

	if @ReturnValue <> 0
		goto ErrorProcess

	--插入收费信息
	insert into Clin_FeeMaster
		(ClinFeeID, ClinID, FeeTime, FeeTypeID, FeeTypeName, OpID, OpName, YBID, 
		SumPrice, YBMoney, CashMoney, DiscountMoney, POSMoney, 
		ETCMoney1, ETCType1, ETCCode1, ETCName1,
		ETCMoney2, ETCType2, ETCCode2, ETCName2,
		GetMoney, ChargeMoney, Memo,
		FeeSign, PID, PatientName, SystemCode, InterfaceID)
	values (@ClinFeeID, @ClinID, @FeeTime, @FeeTypeID, @FeeTypeName, @OpID, @OpName, @YBID, 
		@SumPrice, @YBMoney, @CashMoney, @DiscountMoney, @POSMoney, 
		@ETCMoney1, @ETCType1, @ETCCode1, @ETCName1,
		@ETCMoney2, @ETCType2, @ETCCode2, @ETCName2,
		@GetMoney, @ChargeMoney, @Memo,
		@FeeSign, @PID, @PatientName, @SystemCode, @InterfaceID)

	if @@error <> 0
		goto ErrorProcess
	
	--关联处方表并修改处方状态
	update Clin_RecMaster
	set ClinFeeID = @ClinFeeID, RecSign = @FeeSign  --关联后的处方标识与发票一致
	where (ClinID = @ClinID) and (ClinFeeID = '') 
		and RecipeID in (select item from dbo.Fun_DelimitedTextToTable(@RecipeIDList, ','))
 
	if @@Error <> 0
		goto ErrorProcess
		
	--重要: 填写处方明细的剩余数量(发票数量)、剩余金额(发票金额)，用于后续退费
	update Clin_RecDetail
	set RemainQuan = Quan, RemainPrice = SumPrice
	where RecipeID in (select item from dbo.Fun_DelimitedTextToTable(@RecipeIDList, ','))
	
	if @@Error <> 0
		goto ErrorProcess
		
	--核对收费处方是否全部关联成功
	if exists(select RecipeID from Clin_RecMaster
		where (ClinID = @ClinID) and (ClinFeeID <> @ClinFeeID) and RecipeID in 
			(select item from dbo.Fun_DelimitedTextToTable(@RecipeIDList, ','))
	)
	begin
		raiserror('门诊收费: 处方收费关联出错，请刷新数据，重新操作', 16, 1)
		goto ErrorProcess
	end

	--核对总金额
	exec Pro_Clin_Fee_CalcRecipePrice
		@ClinID = @ClinID, 
		@RecipeIDList = @RecipeIDList,
		@SumPrice = @SumPrice2 output
	
	if (@SumPrice2 <> @SumPrice)
	begin
		raiserror('门诊收费: 核对处方金额出错，请刷新数据，重新操作', 16, 1)
		goto ErrorProcess
	end
	
	commit tran	
	
	select top 1 @DoctorID = DoctorID, @DoctorName = DoctorName,
		@OfficeID = OfficeID, @OfficeName = OfficeName
	from Clin_RecMaster 
	where ClinFeeID = @ClinFeeID 
	
	-- 补充更新医保收费信息
	update His_YB.dbo.YB_ClinMaster
	set FeeTypeName = @FeeTypeName, 
		OpID = @OpID,
		ClinFeeID = @ClinFeeID,
		DoctorID = @DoctorID,
		DoctorName = @DoctorName,
		OfficeID = @OfficeID,
		OfficeName = @OfficeName
	where YBID = @YBID
	
	if @YBID > 0
		update His_YB.dbo.YB_SeverePatient
		set LastClinic = GETDATE()
		from His_YB.dbo.YB_ClinMaster a, His_YB.dbo.YB_SeverePatient b
		where a.YBID = @YBID and a.ZKBH = b.SocialCode and a.BZDM = b.BZCode
	
	return 0	
 
ErrorProcess:
	rollback tran
	return 1
GO


-- ----------------------------
-- Procedure structure for Pro_Clin_Reg_Add
-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[Pro_Clin_Reg_Add]') AND type IN ('P', 'PC', 'RF', 'X'))
	DROP PROCEDURE[dbo].[Pro_Clin_Reg_Add]
GO

CREATE PROCEDURE [dbo].[Pro_Clin_Reg_Add]
	@ClinID      varchar(12) output, 
	@RegPrice    numeric(18,2),
	@DiagPrice   numeric(18,2),
	@CasePrice   numeric(18,2),
	@SumPrice    numeric(18,2),
	@RegTypeID   int,
	@OfficeID    varchar(8),
	@DoctorID    varchar(8),
	@OpID        varchar(8),
	@PatientID   int
AS
	declare @ReturnValue int,
	@PatientName varchar(50),
	@Sex varchar(8),
	@Age int,
	@RegType varchar(20),
	@OpName varchar(20)
	
	select @OpName = OpName
	from His_Sys.dbo.Sys_Op
	where OpID = @OpID

	begin tran
	
	select @PatientName = PatientName,
		@Sex = Sex, @Age = dbo.Fun_YearsOld(Birthday)
	from Clin_Patient 
	where PID = @PatientID
	
	select @RegType = RegType from Clin_RegType where RegTypeID = @RegTypeID
	
	--获取门诊号
	exec @ReturnValue = Pro_Clin_Reg_GetID @ClinID output
  
	if @ReturnValue <> 0
		goto ErrorProcess
	
	insert into Clin_Reg
		(ClinID, RegTypeID, ClinDoctorID, ClinOfficeID, PID, OpID, OpName, RegType,
		RegPrice, DiagPrice, CasePrice, SumPrice, RegSign, PatientName, Sex, Age) 
	values(@ClinID, @RegTypeID, @DoctorID, @OfficeID, @PatientID,@OpID, @OpName, @RegType,
		  @RegPrice, @DiagPrice, @CasePrice, @SumPrice, 0, @PatientName, @Sex, @Age)
 
	if @@error <> 0
		goto ErrorProcess

	--更新患者就诊次数信息
	update Clin_Patient
	set ClinRegCount = ClinRegCount + 1
	where PID = @PatientID

	if @@error <> 0
		goto ErrorProcess
           
	commit tran
	return 0

ErrorProcess:
	rollback tran
	return 1
GO


-- ----------------------------
-- Procedure structure for Pro_Clin_Reg_Return
-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[Pro_Clin_Reg_Return]') AND type IN ('P', 'PC', 'RF', 'X'))
	DROP PROCEDURE[dbo].[Pro_Clin_Reg_Return]
GO

CREATE PROCEDURE [dbo].[Pro_Clin_Reg_Return]
	@ClinID varchar(12),
	@OpID   varchar(8)
AS
declare 
	@ReturnValue int,
	@ReturnID varchar(20),
	@OpName varchar(20)

	select @OpName = OpName
	from His_Sys.dbo.Sys_Op
	where OpID = @OpID
	
	if @OpID = '' or @@ROWCOUNT = 0
	begin
		raiserror('门诊退号，未知操作员', 16, 1)
		goto ErrorProcess
	end
	
	begin tran

	--更新挂号信息表状态 
	update Clin_Reg
	set RegSign= 1
	where ClinID = @ClinID and UseSign = 0 and RegSign = 0

	if (@@ROWCOUNT = 0) or (@@Error <> 0)
	begin
		raiserror('门诊号不存在或已使用，不能办理退号!', 16, 1)
		goto ErrorProcess
	end

	if exists (select * from Clin_Reg where ClinID=@ClinID and (DATEDIFF(MINUTE, RegDate, GetDate()) > 24 * 60))
	begin
		raiserror('此门诊号已过24小时，不能退费!', 16, 1)
		goto ErrorProcess 
	end
	
	--获取门诊号
	exec @ReturnValue = Pro_Clin_Reg_GetID @ReturnID OUTPUT
  
	if @ReturnValue <> 0
		goto ErrorProcess

	--插入挂号退费明细
	insert into Clin_Reg
		 (ClinID, RegTypeID, ClinDoctorID, ClinOfficeID, ClinOfficeName, PID, OpID, OpName,
		  RegPrice, DiagPrice, CasePrice, SumPrice, Memo, 
		  RegSign, PatientName, RegType, Sex, Age, MonthAge, DayAge) 
	select @ReturnID, RegTypeID, ClinDoctorID, ClinOfficeID, ClinOfficeName, PID, @OpID, @OpName,
		  -RegPrice, -DiagPrice, -CasePrice, -SumPrice, @ClinID, 
		  2, PatientName, RegType, Sex, Age, MonthAge, DayAge
	from Clin_Reg
	where ClinID = @ClinID

	if @@Error <> 0
		goto ErrorProcess
		        
	commit Tran	
	return 0

ErrorProcess:
	rollback tran
	return 1
GO


-- ----------------------------
-- Procedure structure for Pro_Clin_Reg_Balance
-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[Pro_Clin_Reg_Balance]') AND type IN ('P', 'PC', 'RF', 'X'))
	DROP PROCEDURE[dbo].[Pro_Clin_Reg_Balance]
GO

CREATE PROCEDURE [dbo].[Pro_Clin_Reg_Balance] 
	@OpID varchar(8),
	@EndDate Datetime,
	@Memo Varchar(100),
	@BalanceID int output
AS
	declare @BalanceTypeID int = 0 --门诊挂号收入类型
	declare @ErrorNum int, @UpdateCount int,
	@OpName varchar(20)

	select @OpName = OpName
	from His_Sys.dbo.Sys_Op
	where OpID = @OpID

	begin tran

	--插入结算记录
	insert into Fee_Balance (SumPrice, RecordCount, ReturnCount, BalanceTime,
		BalanceOpID, BalanceOpName, BalanceTypeID, Memo)	
	select sum(SumPrice), count(*),  
		sum(case when SumPrice < 0 then 1 else 0 end), 
		getdate(), @OPID, @OpName, @BalanceTypeID, @Memo
	from Clin_Reg
	where (RegDate <= @EndDate) and (OpID = @OpID) and (BalanceID = 0)
	
	if @@Error <> 0
		goto ErrorProcess
	
	select @BalanceID = @@identity 

	--更新结算标识
	update Clin_Reg
	set BalanceID = @BalanceID
	where (RegDate <= @EndDate) and (OpID = @OpID) and (BalanceID = 0)

	select @ErrorNum = @@error, @UpdateCount = @@rowcount
	
	if @ErrorNum <> 0
		goto ErrorProcess
		
	if @UpdateCount = 0
	begin
		raiserror('门诊挂号错误：更新的结算笔数为0.', 16, 1)
		goto ErrorProcess
	end
	
	--核对前后的笔数是否一致
	if (select RecordCount from Fee_Balance where BalanceID = @BalanceID) <> @UpdateCount
	begin
		raiserror('门诊挂号结算笔数核对出错，请刷新重试.', 16, 1)
		goto ErrorProcess
	end

	commit tran	
	return 0

ErrorProcess:
	rollback tran
	return 1
GO


-- ----------------------------
-- Procedure structure for Pro_Med_InOut_Receive
-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[Pro_Med_InOut_Receive]') AND type IN ('P', 'PC', 'RF', 'X'))
	DROP PROCEDURE[dbo].[Pro_Med_InOut_Receive]
GO

CREATE PROCEDURE [dbo].[Pro_Med_InOut_Receive]
	@InOutID varchar(12),  --单号
	@OpID varchar(8),  --申请人
	@OfficeID varchar(8),  --申请科室
	@NewState int output  --提交后申请单的状态
as
BEGIN

	begin tran
	
	--状态不变10
	set @NewState = 10

	--只有完成后的申请单才需签收
	update Med_InOutMaster
	set ReceiveOpID = @OpID, 
		ReceiveTime = getdate()
	where InOutID = @InOutID 
		and InOutState = 10
		and ApplyOfficeID = @OfficeID
		and ISNULL(ReceiveOpID, '') = ''
	
	if @@ROWCOUNT = 0 or @@ERROR <> 0
	begin
		raiserror('药品出入库：业务签收失败(可能已签收)，请刷新核对', 16, 1)
		goto ErrorProcess
	end

	commit tran
	return 0

ErrorProcess:
	rollback tran
	return 1
	
END
GO


-- ----------------------------
-- Procedure structure for Pro_Clin_Fee_Balance
-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[Pro_Clin_Fee_Balance]') AND type IN ('P', 'PC', 'RF', 'X'))
	DROP PROCEDURE[dbo].[Pro_Clin_Fee_Balance]
GO

CREATE PROCEDURE [dbo].[Pro_Clin_Fee_Balance] 
	@OpID varchar(8), 
	@EndDate datetime,
	@Memo varchar(50),
	@BalanceID int output
AS
	declare @BalanceTypeID int = 1,  --结算类型：门诊收费
	@OpName varchar(20)

	select @OpName = OpName
	from His_Sys.dbo.Sys_Op
	where OpID = @OpID
  
	begin tran
	
	-- 新增结算记录
	insert into Fee_Balance (SumPrice, RecordCount, ReturnCount, 
		BalanceTime, BalanceOpID, BalanceOpName, BalanceTypeID, Memo)
	select Sum(SumPrice), count(*), sum(case when SumPrice < 0 then 1 else 0 end),
		GETDATE(), @OpID, @OpName, @BalanceTypeID, @Memo 
	from Clin_FeeMaster
	where (FeeTime <= @EndDate) and (OpID = @OpID) and (BalanceID = 0)

	if @@Error <> 0
		goto ErrorProcess
	
	select @BalanceID = @@IDENTITY

	update Clin_FeeMaster
	set BalanceID = @BalanceID
	where (FeeTime <= @EndDate) and (OpID = @OPID) and (BalanceID = 0)

	if @@Error <> 0 or @@ROWCOUNT = 0
	begin
		raiserror('门诊收费结算: 修改收费结算标识出错!', 16, 1)
		goto ErrorProcess
	end
	
	--核对前后的笔数是否一致
	if (select RecordCount from Fee_Balance where BalanceID = @BalanceID) <>
	  (select COUNT(*) from Clin_FeeMaster where BalanceID = @BalanceID)
	begin
		raiserror('门诊收费结算: 笔数核对出错，请重试!', 16, 1)
		goto ErrorProcess
	end
	
	--核对前后的金额是否一致
	if (select SumPrice from Fee_Balance where BalanceID = @BalanceID) <>
	  (select isnull(Sum(SumPrice), 0) from Clin_FeeMaster where BalanceID = @BalanceID)
	begin
		raiserror('门诊收费结算: 金额核对出错，请重试!', 16, 1)
		goto ErrorProcess
	end

	commit tran	
	return 0

ErrorProcess:
	rollback tran
	return 1
GO


