-- ----------------------------
-- Procedure structure for Pro_Clin_Fee_CalcReturnMoney
-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[Pro_Clin_Fee_CalcReturnMoney]') AND type IN ('P', 'PC', 'RF', 'X'))
	DROP PROCEDURE[dbo].[Pro_Clin_Fee_CalcReturnMoney]
GO

CREATE PROCEDURE [dbo].[Pro_Clin_Fee_CalcReturnMoney]
	@ClinFeeID varchar(12), --发票ID
	@SumPrice numeric(18,2) output, --退费总额
	@CashMoney numeric(18,2) output, --退现金
	@DiscountMoney numeric(18,2) output, --退优惠
	@POSMoney numeric(18,2) output,  --退POS
	@YBMoney numeric(18,2) output, --退医保
	@ETCMoney1 numeric(18,2) output, --退其他1
	@ETCMoney2 numeric(18,2) output --退其他2
AS
BEGIN
	declare	@SumPrice2 numeric(18, 2), --原发票金额
	@CashMoney2 numeric(18,2), 
	@POSMoney2 numeric(18,2) = 0,
	@YBMoney2 numeric(18,2) = 0,
	@ETCMoney12 numeric(18,2) = 0,
	@ETCMoney22 numeric(18,2) = 0

    select @SumPrice = isnull(sum(cast(ReturnQuan * CPrice as numeric(18, 2))), 0)
	from Clin_RecMaster inner join Clin_RecDetail on Clin_RecMaster.RecipeID = Clin_RecDetail.RecipeID
	where (ClinFeeID = @ClinFeeID)
	
	select @SumPrice2 = SumPrice,
		@CashMoney2 = CashMoney,
		@POSMoney2 = POSMoney,
		@YBMoney2 = YBMoney,
		@ETCMoney12 = ETCMoney1,
		@ETCMoney22 = ETCMoney2
	from Clin_FeeMaster
	where ClinFeeID = @ClinFeeID
	
	--todo: 首先退优惠
	
	
	--先退其他1
	if @ETCMoney12 > 0
	begin
		set @ETCMoney1 = @SumPrice
		if @ETCMoney1 > @ETCMoney12
			set @ETCMoney1 = @ETCMoney12
	end
	
	--先退其他2
	if @ETCMoney22 > 0
	begin
		set @ETCMoney2 = @SumPrice
		if @ETCMoney2 > @ETCMoney22
			set @ETCMoney2 = @ETCMoney22
	end
	
	--退医保
	set @YBMoney = 0
	
	--退POS
	set @POSMoney = 0
	
	--退现金
	set @CashMoney = @SumPrice - @YBMoney - @POSMoney - @ETCMoney1 - @ETCMoney2

	
END
GO


