CREATE PROCEDURE [dbo].[Pro_Clin_RecMaster_Query]
	@OfficeID varchar(8),
	@OpID varchar(8),
	@QueryFlag int, --查询标志 1门诊医生 2门诊收费
	@ClinID varchar(50)  --门诊号
AS
begin
	SELECT RecipeID, ClinFeeID, left(RecTypeID, 2) as RootRecTypeID,
       RecTypeID, RecType, OfficeID, DoctorID, OfficeName, DoctorName,
       CountTime, CountOpID, (case when RecSign = 1 then 1 else 0 end )RecSign, CheckSign,
       ExtendSign, GroupID, ExecOfficeID, ExecOfficeName,
       (select Sum(SumPrice) from Clin_RecDetail where RecipeID = Clin_RecMaster.RecipeID) as SumPrice,
       ClinID, GroupName, ApplyMemo, ItemCode, ItemApplyID
	FROM Clin_RecMaster
	WHERE ClinID = @ClinID and RecSign = 0
