-- ----------------------------
-- Procedure structure for Pro_Clin_RecMaster_Insert
-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[Pro_Clin_RecMaster_Insert]') AND type IN ('P', 'PC', 'RF', 'X'))
	DROP PROCEDURE[dbo].[Pro_Clin_RecMaster_Insert]
GO

CREATE PROCEDURE [dbo].[Pro_Clin_RecMaster_Insert]
	@RecTypeID varchar(8), 
	@RecType varchar(50), 
	@OfficeID varchar(8), 
	@DoctorID varchar(8), 
	@OfficeName varchar(40), 
	@DoctorName varchar(20), 
	@ClinID varchar(12), 
	@CountTime datetime, 
	@CountOpID varchar(8), 
	@RecSign int, 
	@ExecOfficeID varchar(8), 
	@ApplyMemo varchar(100), 
	@GroupID varchar(32), 
	@GroupName varchar(100), 
	@ItemCode varchar(20), 
	@ExecOfficeName varchar(40), 
	@ExtendSign int
as
BEGIN
	declare 
	@RegDoctorID varchar(8),
	@SickName varchar(100),
	@SystemCode varchar(20)
		
	begin tran
	
	--锁定挂号记录，影响1条数据
	update Clin_Reg
	set UseSign = UseSign
	where ClinID = @ClinID 
	
	if @@ROWCOUNT = 0 or @@ERROR <> 0
	begin
		raiserror('门诊开方：门诊号无效.', 16, 1)
		goto ErrorProcess
	end
	
	select @RegDoctorID = ClinDoctorID,
		@SickName = SickName,
		@SystemCode = isnull(SystemCode, '')
	from Clin_Reg
	where ClinID = @ClinID
		
	--判断是否已填写诊断，体检等除外
	if (@SystemCode = '') and (@RegDoctorID = '' or ltrim(rtrim(@SickName)) = '' )
	begin
		raiserror('门诊开方: 请先填写诊断.', 16, 1)
		goto ErrorProcess
	end
	
	if @RecTypeID = ''
	begin
		raiserror('门诊开方：处方类型不能为空', 16, 1)
		goto ErrorProcess
	end
	
	if @DoctorID = ''
	begin
		raiserror('门诊开方：开方医生不能为空', 16, 1)
		goto ErrorProcess
	end
	
	if @OfficeID = ''
	begin
		raiserror('门诊开方：开方科室不能为空', 16, 1)
		goto ErrorProcess
	end
	
	if @ExecOfficeID = ''
	begin
		raiserror('门诊开方：请选择带有执行科室的处方类别', 16, 1)
		goto ErrorProcess
	end
		
	--院内与院外不能互选
	if @RecTypeID >= '1051' and @RecTypeID <= '1059' 
		and @OfficeID not in ('0158', '0143', '0146', '0145')
	begin
		raiserror('门诊开方：院内不能选择院外门诊的药品处方类型', 16, 1)
		goto ErrorProcess
	end
	
	if left(@RecTypeID, 4) in ('1020', '1120') --自动将门诊重症处方设置为重症标志
		set @ExtendSign = @ExtendSign | 1	
			
	--检查重症处方是否使用医保卡(身份证)挂号
	if ((@ExtendSign & 1) <> 0 or (@ExtendSign & 8) <> 0)
		and (select IDCode from Clin_Patient 
		where PID = (select PID from Clin_Reg where ClinID = @ClinID)) = ''
	begin
		raiserror('门诊开方：患者没有使用医保卡挂号，不能开重症/工伤处方(%s)', 16, 1, @ClinID)
		goto ErrorProcess
	end
			
	--修改挂号就诊标识、就诊时间、就诊医生
	update Clin_Reg
	set UseSign = 1, 
		VisitTime = GETDATE(), 
		ClinDoctorID = @DoctorID
	where ClinID = @ClinID and UseSign = 0

	if @@ERROR <> 0
		goto ErrorProcess

	INSERT INTO Clin_RecMaster
		(RecTypeID, RecType, OfficeID, DoctorID, 
		OfficeName, DoctorName, ClinID, CountTime, CountOpID, 
		RecSign, ExecOfficeID, ApplyMemo, GroupID, GroupName, 
		ItemCode, ExecOfficeName, ExtendSign)
	VALUES
		(@RecTypeID, @RecType, @OfficeID, @DoctorID, 
		@OfficeName, @DoctorName, @ClinID, GETDATE(), @CountOpID, 
		@RecSign, @ExecOfficeID, @ApplyMemo, @GroupID, @GroupName, 
		@ItemCode, @ExecOfficeName, @ExtendSign)

  -- 处方id用作处方号
	update Clin_RecMaster
	set ItemApplyID = @@identity
	where RecipeID = @@identity
	
	if @@ERROR <> 0
		goto ErrorProcess
			
	commit tran	
	return 0

ErrorProcess:
	rollback tran
	return 1
	
END
GO


