CREATE PROCEDURE [dbo].[Pro_Clin_Fee_CalcReturnPrice]
	@ClinFeeID varchar(12), --发票号码
	@SumPrice varchar(18) output --总金额
AS
BEGIN
	declare	@SumPrice2 numeric(18, 2)

    select @SumPrice2 = isnull(sum(cast(ReturnQuan * CPrice as numeric(18, 2))), 0)
	from Clin_RecMaster inner join Clin_RecDetail on Clin_RecMaster.RecipeID = Clin_RecDetail.RecipeID
	where (ClinFeeID = @ClinFeeID)
	
	set @SumPrice = @SumPrice2
	
	return 0
END
GO


-- ----------------------------
-- Procedure structure for Pro_Clin_RecMaster_Delete
-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[Pro_Clin_RecMaster_Delete]') AND type IN ('P', 'PC', 'RF', 'X'))
	DROP PROCEDURE[dbo].[Pro_Clin_RecMaster_Delete]
GO

CREATE PROCEDURE [dbo].[Pro_Clin_RecMaster_Delete]
	@OLD_RecipeID int
as
BEGIN
	begin tran

	DELETE Clin_RecMaster
	WHERE RecipeID = @OLD_RecipeID and RecSign = 0
	
	if @@ROWCOUNT = 0 or @@ERROR <> 0
	begin
		raiserror('门诊处方状态发生变化(收费中)，不允许删除，请刷新核对.', 16, 1)
		goto ErrorProcess
	end
	
	--级联删除明细
	delete Clin_RecDetail
	where RecipeID = @OLD_RecipeID
	
	if @@ERROR <> 0
		goto ErrorProcess
	
	commit tran
	return 0

