GO

CREATE PROCEDURE [dbo].[Pro_Clin_FeeReturnDetail_AfterUpdate]
	@RecDetailID int
as
BEGIN
	declare @RemainQuan numeric(18, 3), @ReturnQuan numeric(18, 3)
	
	--锁定未退费的处方
	update Clin_RecMaster
	set RecTypeID = RecTypeID
	where RecipeID = (select RecipeID from Clin_RecDetail where RecDetailID = @RecDetailID)
		and RecSign = 1
	
	if @@ROWCOUNT = 0 or @@ERROR <> 0
	begin
		raiserror('门诊退费：处方状态发生变化(已退费)，不允许再修改，请刷新核对.', 16, 1)
		goto ErrorProcess
	end
	
	select @RemainQuan = RemainQuan, @ReturnQuan = ReturnQuan
	from Clin_RecDetail
	where RecDetailID = @RecDetailID
	
	if (@ReturnQuan > @RemainQuan)
	begin
		raiserror('退费数量不能超过原始数量.', 16, 1)
		goto ErrorProcess
	end
	
	if (@ReturnQuan < 0)
	begin
		raiserror('退费数量要大于0.', 16, 1)
		goto ErrorProcess
	end

	return 0
 
ErrorProcess:
	return 1
	
END
GO


