-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[Pro_Clin_Reg_Edit]') AND type IN ('P', 'PC', 'RF', 'X'))
	DROP PROCEDURE[dbo].[Pro_Clin_Reg_Edit]
GO

CREATE PROCEDURE [dbo].[Pro_Clin_Reg_Edit]
	@ClinID      varchar(12),
	@OpID        varchar(8),
	@Xml	 xml
AS
	declare @ReturnValue int,
	@XmlDoc int = 0,
	@PatientName varchar(30),
	@Sex varchar(8),
	@Age int,
	@IDCode varchar(20) = '',
	@OfficeID    varchar(8),
	@DoctorID    varchar(8) = '',
	@RegTypeID   int,
	@RegType     varchar(20) = '',
	@RegPrice    numeric(18,2),
	@DiagPrice   numeric(18,2),
	@CasePrice   numeric(18,2) = 0,
	@SumPrice    numeric(18,2),
	@PatientID   int = 0,
	@UnitID      varchar(20)
		
	--判断是否已经是协议单位
	if isnull((select UnitID from Clin_Patient where PID = (select PID from Clin_Reg where ClinID = @ClinID)), '') <> ''
	begin
		raiserror('修改挂号信息失败：不能重复设置协议单位', 16, 1)
		return 1
	end
	
	begin tran
	
	--准备XML文档
	exec sp_xml_preparedocument @XmlDoc output, @Xml

	select @PatientName = PatientName, @Sex = Sex, @Age = Age, @IDCode = IDCode,
		@OfficeID = OfficeID, @RegTypeID = RegTypeID, @RegType = RegType,
		@RegPrice = RegPrice, @DiagPrice = DiagPrice, @SumPrice = SumPrice,
		@UnitID = UnitID
	from openxml (@XmlDoc, '/XMLData/Datasets/Clin_Reg_Help/Row', 0) with 
		(PatientName varchar(30),
		Sex varchar(6),
		Age int,
		IDCode varchar(20),
		OfficeID varchar(8),
		RegTypeID varchar(8),
		RegType varchar(20),
		RegPrice numeric(18, 2),
		DiagPrice numeric(18, 2),
		SumPrice numeric(18, 2),
		UnitID varchar(20))

	if @@ERROR <> 0
		goto ErrorProcess

	--释放XML文档
	exec sp_xml_removedocument @XmlDoc
	set @XmlDoc = 0
	
	--修改协议单位
	update Clin_Patient
	set UnitID = @UnitID
	where PID = (select PID from Clin_Reg where ClinID = @ClinID)
	
	if @@rowcount = 0 or @@ERROR <> 0
	begin
		raiserror('修改挂号信息失败：门诊号不存在或失效.', 16, 1)
		goto ErrorProcess
	end
	
	commit tran
	return 0

ErrorProcess:		
	rollback tran
	return 1
GO


