	begin
		raiserror('门诊处方状态发生变化(收费中)，处方明细不允许删除，请刷新核对.', 16, 1)
		goto ErrorProcess
	end

	delete Clin_RecDetail
	where (RecDetailID = @OLD_RecDetailID)
	
	if @@ERROR <> 0
		goto ErrorProcess
		
	commit tran
	return 0

ErrorProcess:
	rollback tran
	return 1
	
END
GO


