-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[Pro_Clin_RecDetail_Check]') AND type IN ('P', 'PC', 'RF', 'X'))
	DROP PROCEDURE[dbo].[Pro_Clin_RecDetail_Check]
GO

CREATE PROCEDURE [dbo].[Pro_Clin_RecDetail_Check]
	@RecipeID int, 
	@StatTypeID varchar(6), 
	@StatType varchar(30), 
	@YBStatType varchar(30), 
	@FeeID int, 
	@YBFeeID int, 
	@FeeName varchar(100), 
	@Specs varchar(50), 
	@Quan numeric(18, 3), 
	@UnitDose numeric(9, 3), 
	@DoseUnit varchar(20), 
	@DrugUse varchar(20), 
	@Frequency varchar(20), 
	@Dosage numeric(9, 3), 
	@DayCount int, 
	@SumPrice numeric(18, 2), 
	@GroupNum int, 
	@YBType varchar(30), 
	@YBStatTypeID varchar(6), 
	@YBTypeID varchar(3), 
	@YBCode varchar(30), 
	@ItemCode varchar(20), 
	@RecMemo varchar(50), 
	@CUnit varchar(20), 
	@CPrice numeric(18, 3), 
	@DripSpeed int
as
BEGIN
	declare 
	@YBZZCode varchar(10) = '',
	@YBZZName varchar(300) = '',
	@RecTypeID varchar(8)
			
	--锁定正常的处方，审核状态改为未审核
	update Clin_RecMaster
	set --RecTypeID = RecTypeID
		CheckSign = 0
	where RecipeID = @RecipeID 
		and RecSign = 0
	
	if @@ROWCOUNT = 0 or @@ERROR <> 0
	begin
		raiserror('门诊处方状态发生变化(收费中)，处方明细不允许修改，请刷新核对.', 16, 1)
		goto ErrorProcess
	end
	
	select @RecTypeID = RecTypeID
	from Clin_RecMaster
	where RecipeID = @RecipeID
	
	if @FeeName = ''
	begin
		raiserror('门诊处方内容: 请输入项目名称.', 16, 1)
		goto ErrorProcess
	end
	
	if @Quan <= 0
	begin
		set @FeeName = '门诊处方数量须大于0|' + @FeeName
		raiserror(@FeeName, 16, 1)
		goto ErrorProcess
	end
	
	if @CPrice <= 0
	begin
		set @FeeName = '门诊处方单价须大于0|' + @FeeName
		raiserror(@FeeName, 16, 1)
		goto ErrorProcess
	end
	
	--if @SumPrice <= 0
	--begin
	--	raiserror('门诊处方金额须大于0.', 16, 1)
	--	goto ErrorProcess
	--end
		
	--药品处方判断是否停用，不包含院外门诊
	if @RecTypeID < '13' 
		and (select StopSign from His_Base.dbo.Base_FeeInfo where FeeID = @FeeID) & 1 <> 0
		and left(@RecTypeID, 3) <> '105'
	begin
		raiserror('门诊处方内容@ %s 已停用.', 16, 1, @FeeName)
		goto ErrorProcess
	end

	--重症药品核对
	select @YBZZCode = isnull(YBZZCode, '')
	from His_Base.dbo.Base_RecipeType
	where RecTypeID = (select RecTypeID from Clin_RecMaster where RecipeID = @RecipeID)
	
	if @YBZZCode <> ''
	begin
		if CHARINDEX(',' + @YBZZCode + ',', 
			',' + isnull((select YBZZCode from His_Base.dbo.Base_FeeInfo 
			where FeeID = @FeeID ), '') + ',') < 1
		begin
			select top 1 @YBZZName = CodeName
			from His_YB.dbo.[D_YB_病种类别字典表_08]
			where BZCode = @YBZZCode
			
			raiserror('"%s"不在"%s"重症目录中', 16, 1, @FeeName, @YBZZName)
			goto ErrorProcess
		end	
	end
     
	return 0

ErrorProcess:
	return 1
	
END
GO


