CREATE PROCEDURE [dbo].[Pro_Clin_FeeDetail_Return_Update]
	@OLD_RecDetailID int,
	@ReturnQuan numeric(18, 3),
	@ExecOpID varchar(20)
as
BEGIN
    
	declare @RemainQuan numeric(18, 3)
	
	begin tran
	
	--锁定未退费的处方
	update Clin_RecMaster
	set RecTypeID = RecTypeID
	where RecipeID = (select RecipeID from Clin_RecDetail where RecDetailID = @OLD_RecDetailID)
		and RecSign = 1
	
	if @@ROWCOUNT = 0 or @@ERROR <> 0
	begin
		raiserror('门诊退费：处方状态发生变化(已退费)，不允许再修改，请刷新核对.', 16, 1)
		goto ErrorProcess
	end
	
	select @RemainQuan = RemainQuan
	from Clin_RecDetail
	where RecDetailID = @OLD_RecDetailID
	
	if (@ReturnQuan > @RemainQuan)
	begin
		raiserror('退费数量不能超过原始数量.', 16, 1)
		goto ErrorProcess
	end
	
	if (@ReturnQuan < 0)
	begin
		raiserror('退费数量要大于0.', 16, 1)
		goto ErrorProcess
	end
	
	UPDATE Clin_RecDetail
	SET ReturnQuan = @ReturnQuan
	WHERE (RecDetailID = @OLD_RecDetailID)
    
    if @@ERROR <> 0
		goto ErrorProcess
		
	commit tran

	return 0
 
ErrorProcess:
	rollback tran
	return 1
	
