-- ----------------------------
-- Procedure structure for Pro_Clin_Patient_Add
-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[Pro_Clin_Patient_Add]') AND type IN ('P', 'PC', 'RF', 'X'))
	DROP PROCEDURE[dbo].[Pro_Clin_Patient_Add]
GO

CREATE PROCEDURE [dbo].[Pro_Clin_Patient_Add]
	@PatientID int output,
	@PatientName varchar(30),
	@Sex varchar(8),
	@Birthday smalldatetime,
	@IDCode varchar(20),
	@Nation varchar(30),
	@Address varchar(50),
	@UnitID varchar(8),
	@OpID varchar(8) = ''
AS

	begin tran

	if ltrim(@PatientName) = '' or LTRIM(@Sex) = ''
	begin
		raiserror('门诊患者：请输入姓名和性别', 16, 1)
		goto ErrorProcess
	end
	
	if @Sex not in ('男', '女')
	begin
		raiserror('门诊患者：性别只能输入男和女', 16, 1)
		goto ErrorProcess
	end
	
	if @IDCode <> '' 
	begin
		select @PatientID = min(PID)
		from Clin_Patient 
		where IDCode = @IDCode
		
		if LEN(@IDCode) >= 18
		begin
			--身份证号转日期
			set @Birthday = convert(smalldatetime, substring(@IDCode, 7, 8), 112)
			
			if @@ERROR <> 0
				goto ErrorProcess
		end
	end 		
		
	--新建基本信息
	if isnull(@PatientID, 0) = 0
	begin
		set @Birthday = floor(cast(@Birthday as float))
		
		insert into Clin_Patient (
			PatientName, Sex, Birthday, 
			IDCode, Nation, Address, UnitID)
		values (@PatientName, @Sex, @Birthday, 
			@IDCode, @Nation, @Address, @UnitID)
		
		if @@ERROR <> 0
			goto ErrorProcess
	
		select @PatientID = @@IDENTITY		
	end
           
	commit tran
	return 0

ErrorProcess:
	rollback tran
	return 1
GO


