CREATE FUNCTION [dbo].[Fun_Clin_Recipe_CanPrint](
	@RecTypeID varchar(8),
	@CheckSign int
)
returns int  --1可打印 0不可打印
AS
BEGIN
	declare @CheckControl int --0不须审核 1只需审核 2需审核并通过
	
	if left(@RecTypeID, 2) < '13' 
	begin
		
		select @CheckControl = His_Sys.dbo.Fun_GetParam('Drug.Clin.CheckControl', 0)
		
		if isnull(@CheckControl, 0) = 0
			or (@CheckControl = 1 and @CheckSign <> 0)
			or (@CheckControl = 2 and @CheckSign = 1)
			return 1
		else
			return 0
	end
	
	
	return 1

END
GO


