-- Procedure structure for Pro_Clin_Center
-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[Pro_Clin_Center]') AND type IN ('P', 'PC', 'RF', 'X'))
