CREATE PROCEDURE [dbo].[Pro_Clin_Center]
	@OfficeID varchar(8) = '',  --科室ID
	@Num varchar(30) = '',  --号码：门诊号、处方号、卡号、身份证
	@QueryFlag int = 0 --查询标志 1查询历史 2最近全院
AS
begin
	declare @IDCode varchar(20) = ''
	
	-- 通过身份证查询相同患者
	select @IDCode = IDCode
	from Clin_Reg a inner join Clin_Patient b on a.PID = b.PID
	where a.ClinID = @Num
	
	if @QueryFlag = 1 and @IDCode <> ''
	begin
		select top 20 ClinID, a.PatientName, a.Sex, a.Age as YearsOld,  
			dbo.Fun_GetAgeText(a.Age, a.MonthAge, a.DayAge) as AgeText, 
			c.IDCode, ClinOfficeName,
			RegType, RegDate, SystemCode, InterfaceID, a.Memo, c.UnitID,
			RegSign, UseSign, VisitTime, SumPrice, RegTypeID, ClinOfficeID, ClinDoctorID, OpID, a.PID,
			SickName, SickName2, ICD10, Diagnose, HospOfficeID, 
			case when RegDate > getdate() - 2 then 1 else 0 end as CanEdit,
			HospOfficeName, UrgentClass, UrgentSite, UrgentSource
		from  Clin_Reg  a left join Clin_Patient  c on a.PID = c.PID
		where (c.IDCode = @IDCode) and a.ClinID <= @Num and a.RegSign = 0
		order by ClinID desc
	end
	else if @OfficeID <> ''
		--按科室查询最近的挂号信息
		select ClinID, a.PatientName, a.Sex, a.Age as YearsOld, 
			dbo.Fun_GetAgeText(a.Age, a.MonthAge, a.DayAge) as AgeText, 
			c.IDCode, ClinOfficeName,
			RegType, RegDate, SystemCode, InterfaceID, a.Memo, c.UnitID,
			RegSign, UseSign, VisitTime, SumPrice, RegTypeID, ClinOfficeID, ClinDoctorID, OpID, a.PID,
			SickName, SickName2, ICD10, Diagnose, HospOfficeID, 
			case when RegDate > getdate() - 2 then 1 else 0 end as CanEdit, 
			HospOfficeName, UrgentClass, UrgentSite, UrgentSource
		from  Clin_Reg  a left join Clin_Patient  c on a.PID = c.PID
		where a.RegSign = 0 and a.RegDate >= getdate()-0.5 
			and a.ClinOfficeID = @OfficeID
		order by ClinID desc
	else if @Num <> ''
		--todo: 根据号码自动调用体检数据，从而简化流程
		
		--按门诊号、处方号查询
		select ClinID, a.PatientName, a.Sex, a.Age as YearsOld, 
			dbo.Fun_GetAgeText(a.Age, a.MonthAge, a.DayAge) as AgeText, 
			c.IDCode, ClinOfficeName,
			RegType, RegDate, SystemCode, InterfaceID, a.Memo, c.UnitID,
			RegSign, UseSign, VisitTime, SumPrice, RegTypeID, ClinOfficeID, ClinDoctorID, OpID, a.PID,
			SickName, SickName2, ICD10, Diagnose, HospOfficeID, 
			case when RegDate > getdate() - 2 then 1 else 0 end as CanEdit, 
			HospOfficeName, UrgentClass, UrgentSite, UrgentSource
		from  Clin_Reg a  left join Clin_Patient  c on a.PID = c.PID
		where RegSign = 0 and (ClinID = @Num or ClinID = (select ClinID from Clin_RecMaster where ItemApplyID = @Num))
		
	else
		--查询全院最近全部挂号信息  todo: 判断标志
		select ClinID, a.PatientName, a.Sex, a.Age as YearsOld, 
			dbo.Fun_GetAgeText(a.Age, a.MonthAge, a.DayAge) as AgeText, 
			c.IDCode, ClinOfficeName,
			RegType, RegDate, SystemCode, InterfaceID, a.Memo, c.UnitID,
			RegSign, UseSign, VisitTime, SumPrice, RegTypeID, ClinOfficeID, ClinDoctorID, OpID, a.PID,
			SickName, SickName2, ICD10, Diagnose, HospOfficeID, 
			case when RegDate > getdate() - 2 then 1 else 0 end as CanEdit, 
			HospOfficeName, UrgentClass, UrgentSite, UrgentSource
		from  Clin_Reg  a left join Clin_Patient c  on a.PID = c.PID
		where a.RegSign = 0 and a.RegDate >= getdate()-0.5
		order by ClinID desc
end
GO


