CREATE PROCEDURE [dbo].[Pro_Med_Stock_Update]
	@OfficeID varchar(8), 
	@FeeID int, 
	@StockCode varchar(20), 
	@AlarmQuan numeric(18, 3), 
	@LastQuan numeric(18, 3), 
	@LastPrice numeric(18, 3), 
	@StopSign int,
	@OLD_OfficeID varchar(8),
	@OLD_FeeID int
as
BEGIN
	declare @OfficeUse varchar(8),
	@FeeStopSign int,
	@StatType varchar(8)
	
	if @FeeID <> @OLD_FeeID 
	begin
		raiserror('药品库存：不允许修改项目名称', 16, 1)
		return 1
	end
	
	UPDATE Med_Stock
	SET
		--OfficeID = @OfficeID, 
		--FeeID = @FeeID, 
		StockCode = @StockCode, 
		AlarmQuan = @AlarmQuan, 
		LastQuan = @LastQuan, --临时放开
		--LastPrice = @LastPrice, 
		StopSign = @StopSign
	WHERE
		(OfficeID = @OLD_OfficeID) AND 
		(FeeID = @OLD_FeeID)

	EXEC [dbo].[Pro_Med_Stock_SyncStopSign]
		@OfficeID = @OfficeID,
		@FeeID = @FeeID,
		@StopSign = @StopSign
		
	return 0

ErrorProcess:
	rollback tran
	return 1
	
END
GO


