	@OLD_FeeID int
as
BEGIN
	declare @OfficeUse varchar(8)
	
	select @OfficeUse = OfficeUse 
	from His_Sys.dbo.Sys_Office 
	where OfficeID = @OLD_OfficeID
	
	--if @OfficeUse in ('410')  --'420', '430'
	begin
		raiserror('药品库存：不允许删除库存信息%s', 16, 1, @OLD_OfficeID)
