-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[Pro_Clin_Med_Stat]') AND type IN ('P', 'PC', 'RF', 'X'))
	DROP PROCEDURE[dbo].[Pro_Clin_Med_Stat]
GO

CREATE PROCEDURE [dbo].[Pro_Clin_Med_Stat]
	@BeginDate smalldatetime,
	@EndDate smalldatetime,
	@OfficeID varchar(8),
	@OpID varchar(8)
AS
begin
	declare @BeginID varchar(8), @EndID varchar(8)
	
	if DATEDIFF(day, @BeginDate, @EndDate) > 31 
	begin
		raiserror('门诊发药统计：查询时间段不能查过一个月', 16, 1)
		return 0
	end

	select @BeginID = convert(varchar(8), @BeginDate, 112),
		@EndID = convert(varchar(8), @EndDate + 1, 112)

	if His_Sys.dbo.Fun_HavePower(@OpID, @OfficeID, '2021') = 0
		--药品科室查询方式
		select a.ExecOfficeID, c.OfficeName, a.FeeID, b.StatTypeID, d.StatTypeName,
			b.FeeName, b.Specs, b.CUnit, b.CPrice, a.SumQuan, a.SumPrice
		from 
			(select a.ExecOfficeID, b.FeeID, sum(b.Quan) as SumQuan, SUM(b.SumPrice) as SumPrice
				from His_Data.dbo.Clin_RecMaster  a 
					inner join His_Data.dbo.Clin_RecDetail  b on a.RecipeID = b.RecipeID
				where a.ClinFeeID >= @BeginID and a.ClinFeeID < @EndID and ExecOfficeID = @OfficeID
				group by a.ExecOfficeID, b.FeeID) a 
			left join His_Base.dbo.Base_FeeInfo  b on a.FeeID = b.FeeID
			left join His_Sys.dbo.Sys_Office  c on a.ExecOfficeID = c.OfficeID
			left join His_Base.dbo.Base_StatType  d on left(b.StatTypeID, 4) = d.StatTypeID
		order by a.ExecOfficeID, b.StatTypeID
	else
		--统计员查所有药房
		select a.ExecOfficeID, c.OfficeName, a.FeeID, b.StatTypeID, d.StatTypeName,
			b.FeeName, b.Specs, b.CUnit, b.CPrice, a.SumQuan, a.SumPrice
		from 
			(select a.ExecOfficeID, b.FeeID, sum(b.Quan) as SumQuan, SUM(b.SumPrice) as SumPrice
				from His_Data.dbo.Clin_RecMaster  a 
					inner join His_Data.dbo.Clin_RecDetail  b on a.RecipeID = b.RecipeID
				where a.ClinFeeID >= @BeginID and a.ClinFeeID < @EndID and left(a.ExecOfficeID, 4) = '0318'
				group by a.ExecOfficeID, b.FeeID) a 
			left join His_Base.dbo.Base_FeeInfo  b on a.FeeID = b.FeeID
			left join His_Sys.dbo.Sys_Office  c on a.ExecOfficeID = c.OfficeID
			left join His_Base.dbo.Base_StatType  d on left(b.StatTypeID, 4) = d.StatTypeID
		order by a.ExecOfficeID, b.StatTypeID
	
	
	
end
GO


