	declare @FeeListAll varchar(2000)='', 
	@LastFeeList varchar(2000) = '',
	@CurFeeList varchar(2000) = ''
	
	--已优化
	--select @LastFeeList = CAST(@HospFeeID as varchar(20))
	--select @FeeListAll = @LastFeeList
	
	--while 1=1
	--begin
	--	select @CurFeeList = null
		
	--	select @CurFeeList = (case when @CurFeeList is null then '' else @CurFeeList + ',' end) + CAST(@HospFeeID as varchar(20))
	--	from Hosp_FeeMaster
	--	where NewHospFeeID in (select Item from dbo.Fun_DelimitedTextToTable(@LastFeeList, ','))
		
	--	if @CurFeeList is null
	--		break
	--	else begin
	--		set @LastFeeList = @CurFeeList
	--		set @FeeListAll = @FeeListAll + ',' + @CurFeeList
	--	end
	--end
	
	
	--一层一层查找
	select @LastFeeList = @HospFeeID	
	select @FeeListAll = @LastFeeList

	while 1=1
	begin
		select @CurFeeList = ''
		
		select @CurFeeList = (case when @CurFeeList ='' then '' else @CurFeeList + ',' end) + OldHospFeeList
		from Hosp_FeeMaster
		where HospFeeID in (select Item from dbo.Fun_DelimitedTextToTable(@LastFeeList, ','))
		
