-- ----------------------------
-- Procedure structure for Pro_Clin_Fee_ReturnApply
-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[Pro_Clin_Fee_ReturnApply]') AND type IN ('P', 'PC', 'RF', 'X'))
	DROP PROCEDURE[dbo].[Pro_Clin_Fee_ReturnApply]
GO

CREATE PROCEDURE [dbo].[Pro_Clin_Fee_ReturnApply]
	@ClinFeeID varchar(12), --退费发票号
	@WholeReturn int, --1为申请全退
	@OpID varchar(8)
AS
	declare @ReturnValue int
	
	begin tran
	
	--审核退费发票
	update Clin_FeeMaster
	set ReturnSign = ReturnSign
	where ClinFeeID = @ClinFeeID and FeeSign = 1 and ReturnSign <> 1
	
	if (@@rowcount = 0) or (@@error <> 0)
	begin
		raiserror('门诊退费申请：无效发票(%s).', 16, 1, @ClinFeeID)
		goto ErrorProcess
	end
	
	--第一次申请时自动填写退费数量
	if @WholeReturn = 1 and (select ReturnSign from Clin_FeeMaster where ClinFeeID = @ClinFeeID) = 0
	begin
		update Clin_RecDetail
		set ReturnQuan = RemainQuan
		where RecipeID in (select RecipeID from Clin_RecMaster where ClinFeeID = @ClinFeeID)
	
		if (@@ERROR <> 0) or (@@ROWCOUNT = 0)
		begin
			raiserror('门诊退费申请：填写退费数量出错', 16, 1)
			goto ErrorProcess
		end
	end
   
   --标示退费申请状态
	update Clin_FeeMaster
	set ReturnSign = 2
	where ClinFeeID = @ClinFeeID
	
	commit tran
	return 0

ErrorProcess:
	rollback tran
	return 1
GO


