-- ----------------------------
-- Procedure structure for Pro_Med_Stock_SyncStopSign
-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[Pro_Med_Stock_SyncStopSign]') AND type IN ('P', 'PC', 'RF', 'X'))
	DROP PROCEDURE[dbo].[Pro_Med_Stock_SyncStopSign]
GO

CREATE PROCEDURE [dbo].[Pro_Med_Stock_SyncStopSign]
	@OfficeID varchar(8), 
	@FeeID int, 
	@StopSign int
as
BEGIN
	declare @OfficeUse varchar(8),
	@FeeStopSign int,
	@StatType varchar(8)

	begin tran
	
	--更新基本信息表停止标志
	update His_Base.dbo.Base_FeeInfo
	set StopSign = StopSign
	where FeeID = @FeeID

	select @OfficeUse = OfficeUse 
	from His_Sys.dbo.Sys_Office 
	where OfficeID = @OfficeID
	
	select @StatType = left(StatTypeID, 2), 
		@FeeStopSign = StopSign
	from His_Base.dbo.Base_FeeInfo
	where FeeID = @FeeID
	
	if @OfficeUse in ('430', '420', '410') 
	begin
		if (@OfficeUse = '410') begin
			--药库停用
			if @StopSign = 0
				set @FeeStopSign = @FeeStopSign & 0xFB
			else
				set @FeeStopSign = @FeeStopSign | 0x04
		end	
		else if (left(@StatType, 2) = '02')
		begin 
			--中药则门诊住院全停用
			if @StopSign = 0
				set @FeeStopSign = @FeeStopSign & 0xFC
			else
				set @FeeStopSign = @FeeStopSign | 0x03
		end
		else if (@OfficeUse = '430')
		begin 
			--住院药房
			if @StopSign = 0
				set @FeeStopSign = @FeeStopSign & 0xFD
			else
				set @FeeStopSign = @FeeStopSign | 0x02
		end
		else if (@OfficeUse = '420') begin
			--门诊停用
			if @StopSign = 0
				set @FeeStopSign = @FeeStopSign & 0xFE
			else
				set @FeeStopSign = @FeeStopSign | 0x01
		end
		
		update His_Base.dbo.Base_FeeInfo
		set StopSign = @FeeStopSign
		where FeeID = @FeeID
	end
	
	commit tran
	
END
GO


