CREATE PROCEDURE [dbo].[Pro_Clin_Fee_Return]
	@NewFeeID varchar(12) output, --新发票号
	@OldFeeID varchar(12), --退费发票号
	@OpID varchar(8), --操作员
	@SumPrice numeric(18,2), --退费金额
	@DiscountMoney numeric(18,2), --退优惠
	@YBMoney numeric(18,2), --退医保
	@CashMoney numeric(18,2), --退现金
	@POSMoney numeric(18,2),  --退POS
	@ETCMoney1 numeric(18,2), --退其他1
	@ETCType1 varchar(50), --其他支付类别1, 暂忽略，使用原始数据
	@ETCCode1 varchar(50), --其他支付号码1
	@ETCMoney2 numeric(18,2), --其他支付2
	@ETCType2 varchar(50), --其他支付类别2, 暂忽略，使用原始数据
	@ETCCode2 varchar(50), --其他支付号码2
	@GetMoney numeric(18, 2),
	@ChargeMoney numeric(18, 2),
	@Memo varchar(50)
AS
	declare	@ReturnValue int,
	@SumPrice2 numeric(18,2) = 0,
	@OldYBID int,
	@NewYBID int,
	@OpName varchar(20)

	select @OpName = OpName
	from His_Sys.dbo.Sys_Op
	where OpID = @OpID
	
	begin tran

	-- 修改原始发票状态, 发票状态值说明：1正常 2作废 
	update Clin_FeeMaster
	set FeeSign = 2
	where ClinFeeID = @OldFeeID and FeeSign = 1

	if @@rowcount = 0 or @@error <> 0
	begin
		raiserror('门诊退费：修改原始发票状态出错.', 16, 1)
		goto ErrorProcess
	end
	
	--修改原始处方状态,使状态与发票一致
	update Clin_RecMaster
	set RecSign = 2
	where ClinFeeID = @OldFeeID

	if @@error <> 0
		goto ErrorProcess

	--核对退费处方数量
	if exists(select RecDetailID
		from Clin_RecDetail
		where RecipeID in (select RecipeID from Clin_RecMaster where ClinFeeID = @OldFeeID)
			and (ReturnQuan < 0 or ReturnQuan > RemainQuan)
	)
	begin
		raiserror('门诊退费：退费数量不能小于0，并且不能超出原数量', 16, 1)
		goto ErrorProcess
	end

	-- 获取新发票流水号
	exec @ReturnValue = Pro_Clin_Fee_GetID @NewFeeID output
		
	if @ReturnValue <> 0
		goto ErrorProcess
	
	--核对退费金额
	exec @ReturnValue = Pro_Clin_Fee_CalcReturnPrice
		@ClinFeeID = @OldFeeID,
		@SumPrice = @SumPrice2 output
	
	--金额必须与前台一致
	if  (@ReturnValue <> 0) or (@SumPrice2 <> @SumPrice)
	begin
		raiserror('门诊退费：核对退费处方金额出错，请刷新数据，重新操作', 16, 1)
		goto ErrorProcess
	end
	
	--插入医保退费数据
	if @YBMoney > 0
	begin
		select @OldYBID = YBID
		from Clin_FeeMaster
		where ClinFeeID = @OldFeeID
	
		insert into His_YB.dbo.YB_ClinMaster(JZJLH,SDYWH,FeeTypeName,OpID,XM,ZKBH,RYLB,YLFYZE,RYRQ,BZDM,BQDM,
			JBYLFDFY,GRZF,QFJE,ELZFZF,JBYLBLZF,JBYLTCZF,JBGWYBSJZF,JBGWYTCZF,BCFYZE,BCGRFD,SBPF,BCGWYBZ,BCGWYZF,
			CZFJE,GRZHZF,YSFY,ZLFY,GRZHYE,JSRQ,YYFD,CFDXJE,SBBT,SBGRZF,GWYSJZF,WMFYZF,JBYLZHZF,XTJGDM, ClinFeeID,
			DoctorID, DoctorName, OfficeID, OfficeName)
		select JZJLH,SDYWH,FeeTypeName,@OpID,XM,ZKBH,RYLB,-YLFYZE,RYRQ,BZDM,BQDM,
			-JBYLFDFY,-GRZF,-QFJE,-ELZFZF,-JBYLBLZF,-JBYLTCZF,-JBGWYBSJZF,-JBGWYTCZF,-BCFYZE,-BCGRFD,-SBPF,-BCGWYBZ,-BCGWYZF,
			-CZFJE,-GRZHZF,-YSFY,-ZLFY,-GRZHYE,JSRQ,-YYFD,-CFDXJE,-SBBT,-SBGRZF,-GWYSJZF,-WMFYZF,-JBYLZHZF,XTJGDM, @NewFeeID,
			DoctorID, DoctorName, OfficeID, OfficeName
		from His_YB.dbo.YB_ClinMaster
		where YBID = @OldYBID
		
		select @NewYBID = @@IDENTITY
		
		if @NewYBID is not null
			insert into His_YB.dbo.YB_ClinDetail(YBID, JSXM, FYXJ)
			select @NewYBID, JSXM, FYXJ
			from His_YB.dbo.YB_ClinDetail
			where YBID = @OldYBID
	end
	
	--生成新发票  (FeeTypeID取0，与原发票不一致)
	insert into Clin_FeeMaster(ClinFeeID, OldClinFeeID, ClinID, 
		FeeTime, OpID, OpName, SumPrice, DiscountMoney,
		CashMoney, YBMoney, POSMoney, 
		ETCMoney1, ETCType1, ETCCode1, ETCName1,
		ETCMoney2, ETCType2, ETCCode2, ETCName2,
		GetMoney, ChargeMoney,
		FeeTypeID, FeeTypeName, FeeSign, PID, PatientName, 
		SystemCode, InterfaceID, YBID, Memo)
	select @NewFeeID, @OldFeeID, ClinID,
		getdate(), @OpID, @OpName, -@SumPrice, -@DiscountMoney,
		-@CashMoney, -@YBMoney, -@POSMoney,
		-@ETCMoney1, ETCType1, ETCCode1, ETCName1, --使用原始协议单位
		-@ETCMoney2, ETCType2, ETCCode2, ETCName2,
		@GetMoney, @ChargeMoney,  
		FeeTypeID,  FeeTypeName, 1, PID, PatientName,
		SystemCode, InterfaceID, ISNULL(@NewYBID, 0), @Memo
	from Clin_FeeMaster where ClinFeeID = @OldFeeID

	if @@error <> 0
		goto ErrorProcess

	--生成新处方, OldRecID=原处方ID
	insert into Clin_RecMaster (ClinID, RecTypeID, RecType, OfficeID, OfficeName, DoctorID, DoctorName, CountTime,
		CountOpID, ExecOpID, ExecOfficeID, ExecOfficeName, ExecTime, ExecSign, ClinFeeID, RecSign, OldRecID)
	select ClinID, RecTypeID, RecType, OfficeID, OfficeName, DoctorID, DoctorName, GETDATE(),
		@OpID, ExecOpID, ExecOfficeID, ExecOfficeName, GETDATE(), ExecSign, @NewFeeID, 1, RecipeID
	from Clin_RecMaster
	where ClinFeeID = @OldFeeID 
	
	if @@error <> 0
		goto ErrorProcess
		
	--生成处方明细
	insert into Clin_RecDetail (RecipeID, StatTypeID, StatType, FeeID, YBFeeID, 
		YBCode, YBStatTypeID, YBStatType, YBTypeID, YBType, GroupNum,
		FeeName, Specs, CUnit, CRatio, UnitDose, DoseUnit, 
		Dosage, Frequency, DrugUse, CPrice, DayCount, 
		Quan, SumPrice, ReturnQuan, RemainQuan, RemainPrice)
	select a.RecipeID, StatTypeID, StatType, FeeID, YBFeeID, 
		YBCode, YBStatTypeID, YBStatType, YBTypeID, YBType, GroupNum,
		FeeName, Specs, CUnit, CRatio, UnitDose, DoseUnit, 
		Dosage, Frequency, DrugUse, CPrice, DayCount, 
		-ReturnQuan, -ReturnQuan * CPrice, 0, RemainQuan - ReturnQuan,
		RemainPrice - cast(ReturnQuan * CPrice as numeric(18, 2)) --注意计算方法
	from Clin_RecMaster a, Clin_RecDetail b
	where a.ClinFeeID = @NewFeeID and b.RecipeID = a.OldRecID and b.RemainQuan > 0
	
	if (@@ERROR <> 0) or (@@ROWCOUNT = 0)
	begin
		raiserror('门诊退费：生成处方明细出错', 16, 1)
		goto ErrorProcess
	end

    --清除新处方中无明细的处方
    delete from Clin_RecMaster 
	where Clin_RecMaster.RecipeID in (select a.RecipeID
		from Clin_RecMaster a inner join Clin_RecDetail b on a.RecipeID = b.RecipeID
		where a.ClinFeeID = @NewFeeID
		group by a.RecipeID
		having COUNT(*) = 0)

	--设置不可退标志
	if (select SUM(RemainQuan) from Clin_RecMaster a inner join Clin_RecDetail b on a.RecipeID = b.RecipeID
		where a.ClinFeeID = @NewFeeID) = 0
		update Clin_FeeMaster
		set ReturnSign = 1
		where ClinFeeID = @NewFeeID	
	
	commit tran
	return 0

ErrorProcess:
	rollback tran
	return 1
GO


