-- Procedure structure for Pro_Med_InOutMaster_Update
-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[Pro_Med_InOutMaster_Update]') AND type IN ('P', 'PC', 'RF', 'X'))
	DROP PROCEDURE[dbo].[Pro_Med_InOutMaster_Update]
GO

CREATE PROCEDURE [dbo].[Pro_Med_InOutMaster_Update]
	@OLD_InOutID varchar(12),
	@InOutState int,
    @InOutTypeID varchar(3),
    @InOutName varchar(30),
    @InOutSign int,
    @ApplyOfficeID varchar(8) = '',
    @ApplyOfficeName varchar(40) = '',
    @ApplyOpID varchar(8) = '',
    @ApplyOpName varchar(20) = '',
    @ApplyTime smalldatetime = null,
    @AcceptOfficeID varchar(8) = '',
    @AcceptOfficeName varchar(40) = '',
    @AcceptOpID varchar(8) = '',
    @AcceptTime smalldatetime = null,
    @SupplyName varchar(100) = '',
    @InvoiceDate smalldatetime = null,
    @InvoiceCode varchar(40) = '',
    @Memo varchar(50)
as
BEGIN
	UPDATE Med_InOutMaster
	SET 
		SupplyName = @SupplyName, 
		InvoiceDate = @InvoiceDate, 
		InvoiceCode = @InvoiceCode, 
		Memo = @Memo
	WHERE InOutID = @OLD_InOutID and InOutState = 0

	if @@ROWCOUNT = 0 or @@ERROR <> 0
	begin
		raiserror('药品出入库：此业务已提交，不允许修改，请刷新核对(%d)', 16, 1, @OLD_InOutID)
		goto ErrorProcess
	end
	
	return 

ErrorProcess:
	return 
	
END
GO


-- ----------------------------
-- Procedure structure for Pro_Clin_Fee_TakeCheck
-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[Pro_Clin_Fee_TakeCheck]') AND type IN ('P', 'PC', 'RF', 'X'))
	DROP PROCEDURE[dbo].[Pro_Clin_Fee_TakeCheck]
GO

CREATE PROCEDURE [dbo].[Pro_Clin_Fee_TakeCheck]
	@ClinID varchar(12), --门诊号
	@RecipeIDList varchar(2000),  --处方列表，形式：101,102,103,104
	@FeeTypeID int,  --收费类型
	@YBID int, --YBID 关联4005,4006...
	@OpID varchar(8), --操作员
	@SumPrice numeric(18,2), --应收
	@YBMoney numeric(18,2), --医保支付
	@CashMoney numeric(18,2), --现金支付
	@DiscountMoney numeric(18,2), --优惠金额
	@POSMoney numeric(18,2),  --POS支付
	@ETCMoney1 numeric(18,2), --其他支付1
	@ETCType1 varchar(50), --其他支付类别1
	@ETCCode1 varchar(50), --其他支付号码1
	@ETCMoney2 numeric(18,2), --其他支付2
	@ETCType2 varchar(50), --其他支付类别2
	@ETCCode2 varchar(50), --其他支付号码2
	@GetMoney numeric(18, 2), --收款
	@ChargeMoney numeric(18, 2), --找零
	@Memo varchar(50)
AS
	declare @SumPrice2 numeric(18, 2)

	--核对总金额
	exec Pro_Clin_Fee_CalcRecipePrice
		@ClinID = @ClinID, 
		@RecipeIDList = @RecipeIDList,
		@SumPrice = @SumPrice2 output
	
	if (@SumPrice2 <> @SumPrice)
	begin
		raiserror('门诊收费: 核对处方金额出错，请刷新数据，重新操作', 16, 1)
		return 1
	end
	
	if @SumPrice <= 0
	begin
		raiserror('门诊收费：总金额不能小于0', 16, 1)
		return 1
	end
	
	if @SumPrice <> @YBMoney + @CashMoney + @DiscountMoney + @POSMoney + @ETCMoney1 + @ETCMoney2
	begin
		raiserror('门诊收费公式不平衡：总金额=优惠+现金支付+医保支付+POS支付+其他支付', 16, 1)
		return 1
	end

	if @DiscountMoney < 0
		--or @CashMoney < 0
		or @POSMoney < 0 
		or @ETCMoney1 < 0 
		or @ETCMoney2 < 0
	begin
		raiserror('门诊收费：金额出现负数，输入错误', 16, 1)
		return 1
	end

	if @ETCMoney1 <> 0 and @ETCType1 = '' 
	begin
		raiserror('门诊收费：请输入其他支付类型', 16, 1)
		return 1
	end

	if @ETCMoney1 = 0 and @ETCType1 <> '' 
	begin
		raiserror('门诊收费：请输入其他支付金额', 16, 1)
		return 1
	end
	
	if @ETCMoney2 <> 0 and @ETCType2 = '' 
	begin
		raiserror('门诊收费：请输入其他支付类型2', 16, 1)
		return 1
	end
	
	if @GetMoney < @CashMoney 
	begin
		raiserror('门诊收费：请输入收款金额，并大于等于现金支付', 16, 1)
		return 1
	end
	
	return 0
GO


-- ----------------------------
-- Procedure structure for Pro_Med_InOutDetail_Update
-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[Pro_Med_InOutDetail_Update]') AND type IN ('P', 'PC', 'RF', 'X'))
	DROP PROCEDURE[dbo].[Pro_Med_InOutDetail_Update]
GO

CREATE PROCEDURE [dbo].[Pro_Med_InOutDetail_Update]
	@OLD_DetailID int,
	@InOutID int,
	@FeeID int,
	@FeeName varchar(80),
	@Specs varchar(30),
	@Unit varchar(10),
	@FactoryName varchar(50),
	@StatTypeID varchar(6),
	@StatType varchar(20),
	@InPrice numeric(18,3),
	@Price numeric(18,3),
	@PlanQuan numeric(18,3),
	@Quan numeric(18,3),
	@SumPrice numeric(18,3),
	@Batch varchar(12),
	@DisableDate smalldatetime,
	@InvoiceCode varchar(40),
	@InvoiceDate smalldatetime,
	@Memo varchar(40)
as
BEGIN
	declare @Old_FeeID int,
		@Old_PlanQuan numeric(18,3),
		@Old_Quan numeric(18,3),
		@Old_InPrice numeric(18,3),
		@InOutState int,
		@AcceptOfficeID varchar(8),
		@ShapeName varchar(8)
	
	if @FeeID = 0
	begin
		raiserror('药品出入库：请输入项目名称', 16, 1)
		goto ErrorProcess
	end
	
	select @AcceptOfficeID = AcceptOfficeID
	from Med_InOutMaster
	where InOutID = @InOutID
	
	--药库是否停用
	if (@AcceptOfficeID <> '') 
		and (select StopSign from Med_Stock where OfficeID = @AcceptOfficeID and FeeID = @FeeID) <> 0
	begin
		raiserror('药品出入库：该项目药库已停用(%d)', 16, 1, @FeeID)
		goto ErrorProcess
	end
	
	if (@AcceptOfficeID <> '') and (@PlanQuan = 0)
	begin
		raiserror('药品出入库：请输入申请数量', 16, 1, @FeeID)
		goto ErrorProcess
	end
	
	select @ShapeName = ShapeName
	from His_Base.dbo.Base_FeeInfo
	where FeeID = @FeeID
	
	begin tran
	
	--锁定未完成的业务
	update Med_InOutMaster
	set InOutSign = InOutSign
	where InOutID = @InOutID
	
	select @InOutState = InOutState
	from Med_InOutMaster
	where InOutID = @InOutID
	
	select @Old_FeeID = FeeID, @Old_PlanQuan = PlanQuan, 
		@Old_Quan = Quan, @Old_InPrice = InPrice
	from Med_InOutDetail
	where DetailID = @OLD_DetailID

	if @InOutState = 1 and
		(@Old_FeeID <> @FeeID or @Old_PlanQuan <> @PlanQuan or @Old_InPrice <> @InPrice)
	begin
		raiserror('药品出入库：出入库单已提交，名称、申请数量和进价不允许修改，请刷新核对', 16, 1)
		goto ErrorProcess
	end
	else 
	if @InOutState = 10
	begin
		--已完成的申请单不允许改
		if @AcceptOfficeID <> ''
		begin
			raiserror('药品出入库：申请单已接收，明细不允许修改，请刷新核对', 16, 1)
			goto ErrorProcess
		end
		--已完成的出入库单不允许改数量、项目，其他字段可以改
		else if (@Old_FeeID <> @FeeID or @Old_Quan <> @Quan)
		begin
			raiserror('药品出入库：出入库单已提交，名称和数量不允许修改，请刷新核对', 16, 1)
			goto ErrorProcess
		end
		
		UPDATE Med_InOutDetail
		SET 
			Batch = @Batch, --可修改？？
			DisableDate = @DisableDate, --可修改？？
			InvoiceCode = @InvoiceCode, 
			InvoiceDate = @InvoiceDate 
		WHERE DetailID = @OLD_DetailID
	end
	else begin
		--未完成的申请单不允许重复
		if @AcceptOfficeID <> '' and 
			exists(select DetailID from Med_InOutDetail 
			where InOutID = @InOutID and DetailID <> @OLD_DetailID
				and FeeID = @FeeID)
		begin
			raiserror('药品出入库：申请单项目不允许重复输入(%s)', 16, 1, @FeeName)
			goto ErrorProcess
		end
		
		UPDATE Med_InOutDetail
		SET
			FeeID = @FeeID, 
			FeeName = @FeeName, 
			Specs = @Specs, 
			Unit = @Unit, 
			StatTypeID = @StatTypeID, 
			StatType = @StatType, 
			ShapeName = @ShapeName,
			InPrice = @InPrice, 
			Price = @Price, 
			Quan = @Quan, 
			SumPrice = @SumPrice, 
			Batch = @Batch, 
			DisableDate = @DisableDate, 
			FactoryName = @FactoryName, 
			InvoiceCode = @InvoiceCode, 
			InvoiceDate = @InvoiceDate, 
			PlanQuan = @PlanQuan,
			Memo = @Memo
		WHERE DetailID = @OLD_DetailID
		
		if @@ERROR <> 0
			goto ErrorProcess
	end
	
	--todo 更新供应商
	
	commit tran	
	return 

ErrorProcess:
	rollback tran
	return 
	
end
GO


-- ----------------------------
-- Procedure structure for Pro_Clin_Fee_ReturnCheck
-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[Pro_Clin_Fee_ReturnCheck]') AND type IN ('P', 'PC', 'RF', 'X'))
	DROP PROCEDURE[dbo].[Pro_Clin_Fee_ReturnCheck]
GO

CREATE PROCEDURE [dbo].[Pro_Clin_Fee_ReturnCheck]
	@OldFeeID varchar(12), --退费发票号
	@OpID varchar(8), --操作员
	@SumPrice numeric(18,2), --退费金额
	@YBMoney numeric(18,2), --退医保
	@CashMoney numeric(18,2), --退现金
	@DiscountMoney numeric(18,2), --退优惠
	@POSMoney numeric(18,2),  --退POS
	@ETCMoney1 numeric(18,2), --退其他1
	@ETCType1 varchar(50), --其他支付类别1
	@ETCCode1 varchar(50), --其他支付号码1
	@ETCMoney2 numeric(18,2), --其他支付2
	@ETCType2 varchar(50), --其他支付类别2
	@ETCCode2 varchar(50), --其他支付号码2
	@Memo varchar(50)
AS
	declare	
	@TempText varchar(500),
	@ReturnValue int,
	@SumPrice2 numeric(18,2) = 0, 
	@OldSumPrice numeric(18,2), --原金额
	@OldYBMoney numeric(18,2), --原医保
	@OldCashMoney numeric(18,2), --原现金
	@OldDiscountMoney numeric(18,2), --原优惠
	@OldPOSMoney numeric(18,2),  --原POS
	@OldETCMoney1 numeric(18,2), --原其他1
	@OldETCType1 varchar(50), 
	@OldETCCode1 varchar(50), 
	@OldETCMoney2 numeric(18,2), --原其他2
	@OldETCType2 varchar(50), 
	@OldETCCode2 varchar(50) 
	
	--核对退费金额
	exec @ReturnValue = Pro_Clin_Fee_CalcReturnPrice
		@ClinFeeID = @OldFeeID,
		@SumPrice = @SumPrice2 output
	
	--金额必须与前台一致
	if  (@ReturnValue <> 0) or (@SumPrice2 <> @SumPrice)
	begin
		set @TempText = '门诊退费：核对退费处方金额出错，请刷新数据，重新操作.' + @OldFeeID
		raiserror(@TempText, 16, 1)
		return 1
	end
	
	if @SumPrice <> @YBMoney + @CashMoney + @DiscountMoney + @POSMoney + @ETCMoney1 + @ETCMoney2
	begin
		raiserror('门诊退费公式不平衡：退费金额=退优惠+退现金+退医保+退POS+退其他', 16, 1)
		return 1
	end
	
	if @DiscountMoney < 0
		or @CashMoney < 0 --现金可能为负,允许???
		or @POSMoney < 0
		or @ETCMoney1 < 0
		or @ETCMoney2 < 0
	begin
		raiserror('门诊退费：金额出现负数，输入错误', 16, 1)
		return 1
	end
	
	--获取原发票信息
	select @OldSumPrice = SumPrice, 
		@OldCashMoney = CashMoney,
		@OldYBMoney = YBMoney,
		@OldPOSMoney = POSMoney,
		@OldETCMoney1 = ETCMoney1,
		@OldETCType1 = ETCType1,
		@OldETCMoney2 = ETCMoney2,
		@OldETCType2 = ETCType2
	from Clin_FeeMaster
	where ClinFeeID = @OldFeeID
	
	--依据政策，退医保必须相等
	if @YBMoney <> @OldYBMoney
	begin
		set @TempText = '门诊退费：输入的医保金额必须与原金额相等，不能退部分医保.' + @OldFeeID
		raiserror(@TempText, 16, 1)
		return 1
	end
	
	--只能退当天医保
	if @YBMoney > 0 and left(@OldFeeID, 8) <> convert(varchar(8), getdate(), 112)
	begin
		set @TempText = '门诊退费：医保只能当天退.' + @OldFeeID
		raiserror(@TempText, 16, 1)
		return 1
	end
	
	--POS必须相等，不能套现
	if @PosMoney <> @OldPosMoney
	begin
		set @TempText = '门诊退费：输入的POS金额必须与原金额相等，不能退部分POS.' + @OldFeeID
		raiserror(@TempText, 16, 1)
		return 1
	end
	
	--if @PosMoney <> 0 and @PosMoney <> @OldPosMoney
	--begin
	--	raiserror('门诊退费：POS金额必须与原金额相等或者为0，不能退部分POS', 16, 1)
	--	return 1
	--end
	
	--if @OldSumPrice = @SumPrice and @PosMoney <> @OldPosMoney
	--begin
	--	raiserror('门诊退费：全退时，POS金额必须与原金额相等', 16, 1)
	--	return 1
	--end
	
	--ETC1必须相等，不能套现
	if @ETCMoney1 > 0 and @ETCMoney1 <> @OldETCMoney1
	begin
		set @TempText = '门诊退费：输入的其他金额1必须与原金额相等，不能退部分.' + @OldFeeID
		raiserror(@TempText, 16, 1)
		return 1
	end
	
	--ETC2必须相等，不能套现
	if @ETCMoney2 <> @OldETCMoney2
	begin
		set @TempText = '门诊退费：输入的其他金额2必须与原金额相等，不能退部分.' + @OldFeeID
		raiserror(@TempText, 16, 1)
		return 1
	end
	
	return 0
GO


-- ----------------------------
-- Procedure structure for Pro_Med_InOutDetail_Insert
-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[Pro_Med_InOutDetail_Insert]') AND type IN ('P', 'PC', 'RF', 'X'))
	DROP PROCEDURE[dbo].[Pro_Med_InOutDetail_Insert]
GO

CREATE PROCEDURE [dbo].[Pro_Med_InOutDetail_Insert]
	@InOutID int,
	@FeeID int,
	@FeeName varchar(80),
	@Specs varchar(30),
	@Unit varchar(10),
	@FactoryName varchar(50)='',
	@StatTypeID varchar(6),
	@StatType varchar(20),
	@InPrice numeric(18,3) = 0,
	@Price numeric(18,3),
	@PlanQuan numeric(18,3) = 0,
	@Quan numeric(18,3),
	@SumPrice numeric(18,3) = 0,
	@Batch varchar(12) = '',
	@DisableDate smalldatetime = null,
	@InvoiceCode varchar(40) = '',
	@InvoiceDate smalldatetime = null,
	@Memo varchar(40)
as
BEGIN	
	declare @AcceptOfficeID varchar(8),
		@InOutState int,
		@ShapeName varchar(8)
	
	if @FeeID = 0
	begin
		raiserror('药品出入库：请输入项目名称', 16, 1)
		goto ErrorProcess
	end
	
	select @AcceptOfficeID = AcceptOfficeID
	from Med_InOutMaster
	where InOutID = @InOutID
	
	--药库是否停用
	if (@AcceptOfficeID <> '') 
		--and (select OfficeUse from His_Sys.dbo.Sys_Office where OfficeID = @AcceptOfficeID) = '410'
		and (select StopSign from Med_Stock where OfficeID = @AcceptOfficeID and FeeID = @FeeID) <> 0
	begin
		raiserror('药品出入库：该项目药库已停用(%d)', 16, 1, @FeeID)
		goto ErrorProcess
	end
	
	if (@AcceptOfficeID <> '') and @PlanQuan = 0
	begin
		raiserror('药品出入库：请输入申请数量', 16, 1, @FeeID)
		goto ErrorProcess
	end
	
	begin tran
	
	--锁定未完成的业务
	update Med_InOutMaster
	set InOutSign = InOutSign
	where InOutID = @InOutID
	
	select @InOutState = InOutState
	from Med_InOutMaster
	where InOutID = @InOutID
	
	if isnull(@InOutState, 0) <> 0
	begin
		raiserror('药品出入库：申请单已接收，不允许添加明细，请刷新核对', 16, 1)
		goto ErrorProcess
	end
	
	--未完成的申请单不允许重复
	if @AcceptOfficeID <> '' and 
		exists(select DetailID from Med_InOutDetail 
		where InOutID = @InOutID
			and FeeID = @FeeID)
	begin
		raiserror('药品出入库：申请单项目不允许重复输入(%s)', 16, 1, @FeeName)
		goto ErrorProcess
	end
	
	select @ShapeName = ShapeName
	from His_Base.dbo.Base_FeeInfo
	where FeeID = @FeeID
		
	INSERT INTO Med_InOutDetail
		(InOutID, FeeID, FeeName, Specs, Unit
		,FactoryName, StatTypeID, StatType, ShapeName, InPrice
		,Price, PlanQuan, Quan, SumPrice, Batch
		,DisableDate, InvoiceCode, InvoiceDate, Memo)
	VALUES
		(@InOutID, @FeeID, @FeeName, @Specs, @Unit, 
		@FactoryName, @StatTypeID, @StatType, @ShapeName, @InPrice, 
		@Price, @PlanQuan, @Quan, @SumPrice, @Batch, 
		@DisableDate, @InvoiceCode, @InvoiceDate, @Memo)
	
	if @@ERROR <> 0
		goto ErrorProcess
		
	--todo 采购入库自动刷新供应商
	
	commit tran
	return 

ErrorProcess:
	rollback tran
	return 
	
END
GO


-- ----------------------------
-- Procedure structure for Pro_Clin_FeeMaster_GetOne
-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[Pro_Clin_FeeMaster_GetOne]') AND type IN ('P', 'PC', 'RF', 'X'))
	DROP PROCEDURE[dbo].[Pro_Clin_FeeMaster_GetOne]
GO

CREATE PROCEDURE [dbo].[Pro_Clin_FeeMaster_GetOne]
	@ClinFeeID varchar(12)
As
	declare @FeeListAll varchar(2000)='', 
	@OldFeeID varchar(12) = '',
	@CurFeeID varchar(12) = ''
	
	set @CurFeeID = @ClinFeeID
	set @FeeListAll = @ClinFeeID
	
	while 1=1
	begin
		
		select @OldFeeID = isnull(OldClinFeeID, '')
		from Clin_FeeMaster
		where ClinFeeID = @CurFeeID
		
		if @OldFeeID = ''
			break
		else begin
			set @CurFeeID = @OldFeeID
			set @FeeListAll = @FeeListAll + ',' + @OldFeeID
		end
	end
	
	select Item as ClinFeeID from dbo.Fun_DelimitedTextToTable(@FeeListAll, ',')
GO


