-- ----------------------------
-- Procedure structure for Pro_Med_InOutDetail_Delete
-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[Pro_Med_InOutDetail_Delete]') AND type IN ('P', 'PC', 'RF', 'X'))
	DROP PROCEDURE[dbo].[Pro_Med_InOutDetail_Delete]
GO

CREATE PROCEDURE [dbo].[Pro_Med_InOutDetail_Delete]
	@Old_DetailID int
as
BEGIN
	begin tran
	
	--锁定正常的业务单，只有编辑中的业务单才允许删除
	update Med_InOutMaster
	set InOutSign = InOutSign
	where InOutID = (select InOutID from Med_InOutDetail where DetailID = @Old_DetailID) 
		and InOutState = 0
	
	if @@ROWCOUNT = 0 or @@ERROR <> 0
	begin
		raiserror('药品出入库：业务单已提交，明细不允许删除，请刷新核对', 16, 1)
		goto ErrorProcess
	end
	
	delete Med_InOutDetail
	where DetailID = @Old_DetailID
	
	if @@ROWCOUNT = 0 or @@ERROR <> 0
	begin
		raiserror('药品出入库：明细数据删除失败，请刷新核对(%s)', 16, 1)
		goto ErrorProcess
	end
	
	commit tran	
	return 0

ErrorProcess:
	rollback tran
	return 1
	
END
GO


-- ----------------------------
-- Function structure for Fun_Clin_FeeMaster_LinkedOne
-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[Fun_Clin_FeeMaster_LinkedOne]') AND type IN ('FN', 'FS', 'FT', 'IF', 'TF'))
	DROP FUNCTION[dbo].[Fun_Clin_FeeMaster_LinkedOne]
GO

CREATE FUNCTION [dbo].[Fun_Clin_FeeMaster_LinkedOne](
	@ClinFeeID varchar(12)
)
returns varchar(2000)
begin
	declare @FeeListAll varchar(2000)=@ClinFeeID,
	@CurFeeID varchar(12) = @ClinFeeID,
	@OldFeeID varchar(12) = ''
	
	while 1=1
	begin
		
		select @OldFeeID = isnull(OldClinFeeID, '')
		from Clin_FeeMaster
		where ClinFeeID = @CurFeeID
		
		if @OldFeeID = ''
			break
		else begin
			set @CurFeeID = @OldFeeID
			set @FeeListAll = @FeeListAll + ',' + @OldFeeID
		end
	end

	return @FeeListAll
	
end
GO


-- ----------------------------
-- Procedure structure for Pro_Clin_RecMaster_ToExecute
-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[Pro_Clin_RecMaster_ToExecute]') AND type IN ('P', 'PC', 'RF', 'X'))
	DROP PROCEDURE[dbo].[Pro_Clin_RecMaster_ToExecute]
GO

CREATE PROCEDURE [dbo].[Pro_Clin_RecMaster_ToExecute]
	@OfficeID varchar(8) ,  --科室ID
	@Num varchar(20) --号码
AS
begin
	declare
	@ClinID varchar(12) = '',  --门诊号
	@RecipeID varchar(20) = '',  --处方号
	@ClinFeeID varchar(12) = '',  --发票号，与门诊号无法区分???
	@CardNum varchar(20) = ''  --卡号

	if LEN(@Num) = 12 and LEFT(@Num, 1) <> '6' 
		set @ClinID = @Num

	if LEFT(@Num, 1) = '6' 
		set @RecipeID = @Num

	if (@ClinID <> '') or (@RecipeID <> '')
		select (select PatientName from Clin_Reg where ClinID = Clin_RecMaster.ClinID) as PatientName,
			RecipeID, ClinFeeID, ClinID, RecTypeID, RecType, OfficeID, DoctorID, 
			RecSign, ExtendSign, CheckSign, ExecSign, ExecOpID, ExecTime, ExecOfficeID,
			OfficeName, DoctorName, CountOpID as CountOpName, RecMemo, ApplyMemo
		from Clin_RecMaster
		where (ClinID = @ClinID or ItemApplyID = @RecipeID)
			and ExecOfficeID = @OfficeID 
			and RecSign > 0 
			-- and ExecSign=0 显示已执行的处方，便于打印、查询等
	else if @ClinFeeID <> ''
		select (select PatientName from Clin_Reg where ClinID = Clin_RecMaster.ClinID) as PatientName,
			RecipeID, ClinFeeID, ClinID, RecTypeID, RecType, OfficeID, DoctorID, 
			RecSign, ExtendSign, CheckSign, ExecSign, ExecOpID, ExecTime, ExecOfficeID,
			OfficeName,	DoctorName,	CountOpID CountOpName,	RecMemo, ApplyMemo
		from Clin_RecMaster
		where ClinFeeID = @ClinFeeID 
			and ExecOfficeID = @OfficeID 
			--and ExecSign = 0
	else 
		--最近未执行的处方
		select (select PatientName from Clin_Reg where ClinID = Clin_RecMaster.ClinID) as PatientName, 
			RecipeID, ClinFeeID, ClinID, RecTypeID, RecType, OfficeID, DoctorID, 
			RecSign, ExtendSign, CheckSign, ExecSign, ExecOpID, ExecTime, ExecOfficeID,
			OfficeName,	DoctorName,	CountOpID as CountOpName, RecMemo, ApplyMemo
		from Clin_RecMaster
		where ClinFeeID > CONVERT(varchar(8), getdate()-2, 112) 
			and ExecOfficeID = @OfficeID 
			and ExecSign = 0
		order by ClinFeeID desc
	
end
GO


-- ----------------------------
-- Procedure structure for Pro_Clin_RecMaster_Lock
-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[Pro_Clin_RecMaster_Lock]') AND type IN ('P', 'PC', 'RF', 'X'))
	DROP PROCEDURE[dbo].[Pro_Clin_RecMaster_Lock]
GO

CREATE PROCEDURE [dbo].[Pro_Clin_RecMaster_Lock]
	@ClinID varchar(12), --门诊号
	@RecipeIDList varchar(1000) --处方列表，形式：101,102,103,104
AS
BEGIN
	declare @ErrorNum int, @UpdateCount int
	declare @TempText varchar(1200)
	
	begin tran
	
    update Clin_RecMaster 
	set RecSign = 999,  --999表示锁定状态
		LockTime = GETDATE()
	where (ClinID = @ClinID) 
		and RecipeID in (select item from dbo.Fun_DelimitedTextToTable(@RecipeIDList, ','))
		and RecSign = 0
		
	select @ErrorNum = @@error, @UpdateCount = @@rowcount
	
	if @ErrorNum <> 0
		goto ErrorProcess
	
	--判断处方数量是否与修改数量一致
	if (@UpdateCount = 0) or ((select count(*) from dbo.Fun_DelimitedTextToTable(@RecipeIDList, ',')) <> @UpdateCount)
	begin
		select @TempText = '错误：处方锁定失败，请刷新重试. 门诊号:' + @ClinID + ' 处方列表:' + @RecipeIDList
		raiserror(@TempText, 16, 1)
		goto ErrorProcess
	end
	
	commit tran
	return 0
	
ErrorProcess:
	rollback tran
	return 1
	
END
GO


-- ----------------------------
-- Procedure structure for Pro_Clin_RecMaster_Execute
-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[Pro_Clin_RecMaster_Execute]') AND type IN ('P', 'PC', 'RF', 'X'))
	DROP PROCEDURE[dbo].[Pro_Clin_RecMaster_Execute]
GO

CREATE PROCEDURE [dbo].[Pro_Clin_RecMaster_Execute]
	@RecipeID int,  --处方ID
	@OpID varchar(8),  --操作员ID
	@OfficeID varchar(8)  --科室ID
as
BEGIN
	declare @LastError int, @LastCount int,
	@RecSign int = 0, @ExecSign int = 0,
	@NotExistFeeName varchar(300) = ''

	begin tran
	
	select @RecSign = RecSign, @ExecSign = ExecSign
	from Clin_RecMaster
	where RecipeID = @RecipeID
	
	if @RecSign <= 0
	begin
		raiserror('门诊：处方未缴费，不能执行.', 16, 1)
		goto ErrorProcess
	end
	
	if @ExecSign > 0
	begin
		raiserror('门诊：处方已执行,请刷新核对.', 16, 1)
		goto ErrorProcess
	end
	
	--修改处方执行标志，可执行的处方：处方标志>0，或者是发票号不为空
	update Clin_RecMaster
	set ExecSign = 1, ExecOpID = @OpID, ExecTime = getdate()
	where RecipeID = @RecipeID and RecSign > 0 and ExecSign = 0 and ExecOfficeID = @OfficeID
	
	if @@rowcount = 0 or @@error <> 0
	begin	
		raiserror('门诊: 处方执行失败, 请刷新核对', 16, 1)
		goto ErrorProcess
	end
	
	--根据科室用途或者处方类别判断是否需要执行出库操作
	if left((select OfficeUse from His_Sys.dbo.Sys_Office where OfficeID = @OfficeID), 1) <> '4'
		goto SuccessProcess
	
	--以下为发药
	
	--修改库存防死锁语句：锁定相同记录，达到排队效果
	update His_Sys.dbo.Sys_Office
	set OrderID = OrderID
	where OfficeID = @OfficeID
	
	if @@ERROR <> 0 or @@ROWCOUNT = 0
	begin
		raiserror('门诊：执行处方时，排队机制失败', 16, 1)
		goto ErrorProcess
	end
	
	--自动添加缺少的库存项目，添加之后可省略后面的判断缺少的库存项目
	insert into Med_Stock (OfficeID, FeeID)
	select distinct @OfficeID, FeeID --相同处方可有相同药品
	from Clin_RecDetail
	where RecipeID = @RecipeID
		and FeeID not in (select FeeID from Med_Stock where OfficeID = @OfficeID)

	--修改库存。库存单位是药库单位，处方单位是门诊单位，数量需按拆零比进行转换
	update Med_Stock
	set OutQuan = OutQuan + a.Quan / a.CRatio, OutPrice = OutPrice + a.SumPrice,
		CurQuan = CurQuan - a.Quan / a.CRatio, CurPrice = CurPrice - a.SumPrice
	from Clin_RecDetail a 
	where RecipeID = @RecipeID and Med_Stock.OfficeID = @OfficeID
		and Med_Stock.FeeID = a.FeeID
	
	select @LastCount = @@rowcount, @LastError = @@error

	if @LastError <> 0
		goto ErrorProcess
	
	--提取不存在的库存项目
	select top 1 @NotExistFeeName = '门诊：执行处方时，缺少库存项目: ' + FeeName
	from Clin_RecDetail
	where RecipeID = @RecipeID and FeeID not in
		(select FeeID from Med_Stock where OfficeID = @OfficeID)
	
	if isnull(@NotExistFeeName, '') <> ''
	begin
		raiserror(@NotExistFeeName, 16, 1)
		goto ErrorProcess
	end

SuccessProcess:
	commit tran
	return 0

ErrorProcess:
	rollback tran
	return 1
	
END
GO


