-- ----------------------------
-- Procedure structure for Pro_Clin_RecDetail_Print
-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[Pro_Clin_RecDetail_Print]') AND type IN ('P', 'PC', 'RF', 'X'))
	DROP PROCEDURE[dbo].[Pro_Clin_RecDetail_Print]
GO

CREATE PROCEDURE [dbo].[Pro_Clin_RecDetail_Print]
	@RecipeID int --医嘱ID
as
BEGIN

	SELECT '1' as SN, GroupNum/10000 as GroupNum, RecDetailID, FeeName, Specs, Dosage, DoseUnit, DayCount, Frequency, DrugUse 
	FROM Clin_RecDetail
	WHERE RecipeID = @RecipeID
	 and DrugUse in (select DrugUse from His_Base.dbo.D_DrugUse where InjectSign=1)
	 --and (Frequency in ('qd', 'bid', 'q12h', 'q8h', 'q6h', 'q4h', 'tid') 
		--or Frequency in (select Item from dbo.Fun_DelimitedTextToTable(@Frequency, ',')))

	union all

	SELECT '2' as SN, GroupNum/10000 as GroupNum, RecDetailID, FeeName, Specs, Dosage, DoseUnit, DayCount, Frequency, DrugUse 
	FROM Clin_RecDetail
	WHERE RecipeID = @RecipeID 
	 and DrugUse in (select DrugUse from His_Base.dbo.D_DrugUse where InjectSign=1)
	  and Frequency in ('bid', 'q12h', 'q8h', 'q6h', 'q4h', 'tid') 

	union all

	SELECT '3' as SN, GroupNum/10000 as GroupNum, RecDetailID, FeeName, Specs, Dosage, DoseUnit, DayCount, Frequency, DrugUse 
	FROM Clin_RecDetail
	WHERE RecipeID = @RecipeID 
	 and DrugUse in (select DrugUse from His_Base.dbo.D_DrugUse where InjectSign=1)
	 and Frequency in ('q8h', 'q6h', 'q4h', 'tid') 

	union all

	SELECT '4' as SN, GroupNum/10000 as GroupNum, RecDetailID, FeeName, Specs, Dosage, DoseUnit, DayCount, Frequency, DrugUse 
	FROM Clin_RecDetail
	WHERE RecipeID = @RecipeID 
	 and DrugUse in (select DrugUse from His_Base.dbo.D_DrugUse where InjectSign=1)
	 and Frequency in ('q6h', 'q4h') 

	union all

	SELECT '5' as SN, GroupNum/10000 as GroupNum, RecDetailID, FeeName, Specs, Dosage, DoseUnit, DayCount, Frequency, DrugUse 
	FROM Clin_RecDetail
	WHERE RecipeID = @RecipeID 
	 and DrugUse in (select DrugUse from His_Base.dbo.D_DrugUse where InjectSign=1)
	 and Frequency = 'q4h' 

	union all

	SELECT '6' as SN, GroupNum/10000 as GroupNum, RecDetailID, FeeName, Specs, Dosage, DoseUnit, DayCount, Frequency, DrugUse 
	FROM Clin_RecDetail
	WHERE RecipeID = @RecipeID 
	 and DrugUse in (select DrugUse from His_Base.dbo.D_DrugUse where InjectSign=1)
	 and Frequency = 'q4h' 

	order by GroupNum, SN, RecDetailID


	
END
GO


-- ----------------------------
-- Procedure structure for Pro_Clin_Fee_CalcDiscount
-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[Pro_Clin_Fee_CalcDiscount]') AND type IN ('P', 'PC', 'RF', 'X'))
	DROP PROCEDURE[dbo].[Pro_Clin_Fee_CalcDiscount]
GO

CREATE PROCEDURE [dbo].[Pro_Clin_Fee_CalcDiscount]
	@ClinID varchar(12), --门诊号
	@RecipeIDList varchar(2000), --处方列表，","隔开
	@FeeTypeID int, --收费类型
	@CardNum varchar(20), --卡号(目前是协议单位代码)
	@Discount varchar(18) output --优惠
AS
BEGIN
	declare	@Discount2 numeric(18, 2) = 0
	
	if rtrim(@CardNum) = ''
		select @CardNum = isnull(b.UnitID, '')
		from Clin_Reg a, Clin_Patient b
		where a.ClinID = @ClinID and a.PID = b.PID

	select @Discount2 = isnull(SUM(c.StatSumPrice * a.Discount), 0)
	from His_Base.dbo.d_AgreementDiscount a inner join
		(select StatTypeID, SUM(SumPrice) as StatSumPrice
		from Clin_RecMaster inner join Clin_RecDetail on Clin_RecMaster.RecipeID = Clin_RecDetail.RecipeID
		where Clin_RecMaster.RecipeID in (select item from dbo.Fun_DelimitedTextToTable(@RecipeIDList, ','))
		group by StatTypeID) c on a.StatTypeID = c.StatTypeID
	where a.UnitID = @CardNum
	
	--todo: 只有普通收费才优惠??? 最高优惠额度???
	
	select @Discount = @Discount2
END
GO


